    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_LAN_Turtle" src = "Images/LANTurtle.jpeg" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "premise" style = "text-align: center; color: #D43F52;">Premise ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The two scripts that are going to be used are the ones from the previous article on "How to Botnet". The client side is going to be integrated with Arduino, where it will will write its own code live and connect back to the server, whereas the server side, the python script, is going to sit in a listening state on the system, waiting for the client to connect to it so it can be fed instructions from the client side to control the system. Traditionally you always want to have the server sitting on the victim system so that you can connect and interact with it, but nowadays making your back-doors peer to peer is actually best because it allows your setup to be more versatile. For safety purposes, it's just going to connect back and that's it, nothing else! The real version that is unsafe to use stays with me. </p> <p></p> <p>Sadly, this is one of those projects that you NEED to have the right equipment for to pull off, but you can still follow along the 2 demonstration videos here. One, that shows the code being automated, and then another, of me connecting it live in front of you as proof it works. </p> ğŸƒ <a href = "https://www.youtube.com/watch?v=xEtP3p976dM" style = "text-decoration: none;">YouTube LIVE Demo</a> </br> </br> ğŸƒ <a href = "https://drive.google.com/file/d/1dJtIvUE0sjXatg6xlN_iNqjcDlSjP1X3/view?usp=sharing" style = "text-decoration: none;"> Physical LIVE Demo</a> </br> </br> ğŸƒ <a href = "https://github.com/RoyMBull/Python-Pen-Testing-Tools/blob/main/Python%20PenTesting%20Tools/TCPServerBackDoor.py" style = "text-decoration: none;">TCP Server Backdoor Script</a> </br> </br> ğŸƒ <a href = "https://www.adafruit.com/product/2771?gad_source=1&gclid=CjwKCAiA29auBhBxEiwAnKcSqhgYKutZ7hyr7HrVcAtP2s6pWWmpxFnqvGjif_qa6GxIQivcWPL05BoCGB4QAvD_Bw" style = "text-decoration: none;">Link to board</a> </br> </br> ğŸƒ <a href = "https://adafruit.github.io/arduino-board-index/package_adafruit_index.json" style = "text-decoration: none;">Link to json file for board</a> </br> </br> ğŸƒ <a href = "https://www.arduino.cc/en/software" style = "text-decoration: none;">Link to Arduino IDE: (USE THE 2.O OR HIGHER ONE!!!)</a> </br> </br> </br> <h4 id = "rubber" style = "text-align: center; color: #D43F52;">What is a Rubber Ducky? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>A rubber ducky is a keyboard injection exploit that uses pre-rendered keystrokes via virtual keyboard in order to inject a series of commands and payloads that infect the system in a variety of ways. It does this by communicating with the virtual keyboard on the kernel layer of your operating system. This allows it to mimic and control the system as if it were an actual person.</p> <p></p> <p>Think of it like if I were to program it to write out this whole articles in front of you in a matter of seconds. You can do all sorts of stuff: pop open shells, run scripts, have it write it's own code and then execute it, log into accounts, botnet a system, even serve as a form of retro malware or a bruteforcer tool if you wanted to.</p> </br></br> <h4 id = "ducky" style = "text-align: center; color: #D43F52;">Why is it called a Rubber Ducky? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>It's commonly known as a rubber ducky due to its innocent-like appearance. The goal of it typically is to insert it manually, OR, have someone pick it up and connect it to a USB port on a system, triggering it to go off. There are many ways to create one, but for today, we are going to do it using the Arduino libraries "keyboard" module to get this up and running.</p> <p></p> <p>Sadly at the time of making this I had to do more work than necessary since I didn't have storage means to load my code when it connects... SOOO..... I HAD IT WRITE IT'S OWN CODE LIVE. It's actually more impressive when you see the code write itself live in front of you.</p> <p></p> <p>Before we start this, let's go over some of the main key functions so that you understand what is going on.</p> </br></br> <img src="Images/counter.png" class="img-responsive" alt="portfolio img"> </br></br> <p> If you would like to see the more advanced version of this article that talks about methods that can be used to mitigate, as well as any videos included, SUBSCRIBE TO MY PATREON CYBER SECURITY TIER! </p> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://futabawebs.github.io/Articles/LANTurtle" style = "text-decoration: none;"> <div class="d-grid">  </a>`;


