function Tor()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Generic" src = "Images/mrrobot.jpeg" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "premise" style = "text-align: center; color: #D43F52;">Premise ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>We are also going to talk about the TOR Onion protocol, as well as how to bypass it. We are also going to discuss online anonymity, and how to setup and configure TOR so you can be "truly" anonymous.</p> <p></p> <p>In order to discuss this I need to go over the 3 layers of the internet: The surface web, deep web, and dark web.</p> </br></br> <h4 id = "surface" style = "text-align: center; color: #D43F52;">What is the Surface Web? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The surface web is what we use on a regular day to day basis: work memes, YouTube, etc. It's where the least of the internet is to be explored.</p> </br></br> <h4 id = "deep" style = "text-align: center; color: #D43F52;">What is the Deep Web? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The deep web, which is to not be confused for the Dark web, is where various information archives that arenâ€™t typically available on the surface web can be found. This is where most data breach information is typically leaked, and is also where you can find the "hidden wiki" which is what you need in order to find and access dark web pages</p> </br></br> <h4 id = "dark" style = "text-align: center; color: #D43F52;">What is the Dark Web? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The dark web is the internet without any makeup, and is where true levels of anonymity and cyber criminal activity lurk. This is the least safe part of the internet to browse and if you are not careful you could be traced and put yourself as well as others you might live with at risk. A lot of human trafficking operations, organized crime, hackers for hire (black hats), and other crazy stuff goes on here.</p> <p></p> <p>For the sake of anonymity and security links to the "onion" sites are typically hidden and hard to find, and or available on "hidden wiki's" from the deep web. In order to access the Dark Web you'll need a special browser called "Tor"</p> </br></br> <h4 id = "tor" style = "text-align: center; color: #D43F52;">How Does TOR Onion Protocol Work? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The TOR Onion protocol is what's used to connect to dark web, one of the 3 layers of the internet, and is where most illegal activity and transactions occur. TOR operates by forwarding and handling end user data communications, proxy chaining them through dedicated TOR onion servers in order to spoof the end users</p> </br></br> <h4 id = "usetor" style = "text-align: center; color: #D43F52;">How to use TOR? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>If you would like to learn how to use TOR, check out my video here on how to set that all up for you</p> <p></p> <p><a href = "https://www.youtube.com/watch?v=YkGqiIE38Ws" style = "text-decoration: none;">How To Setup Tor</a></p> <p></p> <p>I also have a custom script that installs the TOR program as well as the browser and allows you to easily set all of that up. DO NOT USE TOR FROM THE COMFORT OF YOUR OWN HOME! IT'S NOT SAFE AND YOU CAN STILL BE TRACED IF YOU DO NOT KNOW WHAT YOU ARE DOING!</p> <p></p> <p><a href = "https://github.com/RoyMBull/Bash-Shell-Scripting/blob/main/Bash%20Shell%20Scripting/MasterScriptFWebsVer4.sh" style = "text-decoration: none;">Master Script</a></p> </br></br> <h4 id = "anonymous" style = "text-align: center; color: #D43F52;">Is there such a thing as true anonymity? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Sadly, NO, there isn't. For as long as any and all software are man made, there will exist vulnerabilities that allow you to exploit and bypass any form of anonymous protocol in place. You can make it hard to crack, but eventually it's going to get hacked.</p> <p></p> </br></br> <h4 id = "episode1" style = "text-align: center; color: #D43F52;">Mr.Robot Episode 1 â€œeps1.0_hellofriend[.]movâ€ ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>During episode 1 of Mr.Robot, Elliot confronts a coffee shop owner named â€œRonâ€, who runs a TOR server that serves child pornography content on it. The coffee shop is a masquerade to hide his servers in plain sight since itâ€™s hosted securely on his internal network via gigabit internet, which he also makes available to customers to put on a good cover front.</p> <p></p> </br></br> <h4 id = "oninonserver" style = "text-align: center; color: #D43F52;">Why were the Ronâ€™s Onion servers hosted on his internal network? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Ron hosted the servers internally on his own network in order to preserve his anonymity. This keeps it out of the sight of the law enforcement and viewable only to the specific audience that he caters it to.</p> <p></p> <p>In order for one to maintain anonymity when hosting a [.]Onion server on the dark web it is CRUCIAL for it to be hosted on one's own PRIVATE servers, NOT a public domain, where it can easily be found and compromised. </p> <p></p> <p>The URL link to access the site needs to also be "VIP", where it's essentially hidden in areas of the deep web, while also being given to a select few via various means: WhatsApp, Telegram, hidden Wiki Pages, etc.</p> <p></p> <p>The reason the pages need to be hidden is so that it stays off the ranges of the law enforcement, A.K.A the FBI, which typically is responsible for seizing and shutting down illegal operations on the dark web.</p> </br></br> <h4 id = "privateserver" style = "text-align: center; color: #D43F52;">How to Host a PRIVATE web Server? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>In order to host your own [.]Onion server you need to understand what port forwarding is. This is crucial and is how Ron was able to host his own TOR servers private on his internal network. Let's dive into what port forwarding is.</p> <p></p> <p>Port forwarding allows you to map internal IP's/ports on a network to an external gateway interface, your router. Here's how the process works. You essentially map an internal IP address and port number from a local system on your network to one of the available ports on your router, so that it's facing the internet. This is going to map the service to the public IP address assigned to the router via the ISP, as well as the port we just set for it. This allows the service to be discoverable by internal and external network devices, meaning if you wanted to host your own website from the comfort of your own home, you could, as well as a variety of different services. Be mindful when you set this, the ports don't have to be the same, meaning you can mismatch them if you want to.</p> </br></br> <h4 id = "majorflaw" style = "text-align: center; color: #D43F52;">TOR's Major Flaw and how a Ron got hacked? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>So the biggest question is, how was Elliot able to bypass Tor's security and hack Ronâ€™s TOR server if they were truly anonymous? Well, the answer is quite simple, he wasnâ€™t. Ron was only anonymous when his internal network traffic became external and was routed through TOR's Onion servers, allowing him to change his public IP and proxy it to host it more securely and anonymously. This means that even if the FBI did manage to find the server, the his true identity would be truly anonymous and protected, more so if they didn't leave behind sensitive information about those that were involved with the site. This would also allow him to discard server data should he be compromised.</p> <p></p> <p>The problem with this is TOR only works when it's able to leave the internal network and communicate with TOR's onion servers. Any and all traffic that hasn't left the network yet is fully exposed and can be intercepted if someone breaches the internal network, which allows stuff like DNS spoofing and parsing techniques that can strip secure network traffic and handle it on behalf of the real DNS server itself, forwarding it as if it were never intercepted. </p> <p></p> <p>This also allows an attacker to bypass any form of segmentation that the main access point might have set in place on the local network. This is crucial in that it allowed Elliot to find the server on the local network regardless of whether or Ron might have had proper segmentation and routing configurations in place.</p> <p></p> <p>Regardless of how segmentation on the network is configured, any and ALL network traffic eventually has to talk to the final endpoint node on the network, the default gateway router. Because of this, Elliot was able to intercept the traffic and bypass the TOR onion protocol and locate, as well as excavate any and all sensitive data from the servers and put in an anonymous tip with the law enforcement to have Ron arrested with solid evidence to shut him down for good.</p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://futabawebs.github.io/Articles/BypassingTor" style = "text-decoration: none;"> <div class="d-grid">  </a>`;

}

function WifiHacking()
