    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Generic" src = "Images/WifiHackingwithAircrackNg.png" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "premise" style = "text-align: center; color: #D43F52;">Premise ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>So how does the process work? Well it depends on the type of Wireless security you are trying to crack. In this case since itâ€™s WPA2, the end goal is to intercept the main handshake that occurs between the host and access point when it connects to the network.</p> <p></p> <p>Now you might be wondering, how do you get that information if host systems are already connected to AP? The handshake is complete so thereâ€™s no way to get that information right? Wait for them to reconnect? Why wait when you can just force them. What you essentially need to do in order to bypass the security, is â€œde-authenticateâ€ them from the network, forcing them to reconnect.</p> <p></p> <p>In order to do this you need to tell the AP directly to de-authenticate them since itâ€™s impossible to talk to the specific hosts on the network when you donâ€™t have access to it.Think of the WAP as an HTTP web application server you can send requests and various HTTP headers to, to invoke various responses. In this process we are essentially doing the same thing, sending the right data packets in order to kick end users off the main access point and scan for the handshake in the process. All you NEED, is the right NIC card to perform passive recon for data packets.</p> <p></p> <p>The first step is to use airmon-ng in order to place your main NIC card into something that is called â€œmonitor modeâ€. Monitor mode allows your NIC card to perform passive recon and sniff out any WAPâ€™s, as well as host systems connected to them. It can also be used to check and kill any processes that might interfere with the scan such as the NetworkManager service for example. The next step is to use the airodump-ng command in order to scan RF channels to search for the SSID of the network AP you wish to target.</p> <p></p> <p>Once found, you can hone in on the AP and see any and all main systems that are connected to it as well, including any MAC addresses that could possibly allow you to bypass stuff like MAC filters that require you to have a trusted MAC address in order to connect to the network.</p> <p></p> <p>Next thing you want to do, while scanning the main AP with airodump-ng is pop open another shell session and then use the aireplay-ng command in order to send authentication packets to force end users to reconnect in order to secure the handshake. THIS PROCESS DOES TAKE TIME.</p> <p></p> <p>Now the question is, how to defend against this. Nowadays, APâ€™s are essentially â€œrandomizingâ€ the frequency channel to prevent people from scanning the access point.If you canâ€™t scan it, then you canâ€™t see the hosts that are on the network, as well as secure the main handshake. Itâ€™s something so simple that can stop hackers in their tracks.</p> </br></br> <img src="Images/counter.png" class="img-responsive" alt="portfolio img"> </br></br> <p> If you would like to see the more advanced version of this article that talks about methods that can be used to mitigate, as well as any videos included, SUBSCRIBE TO MY PATREON CYBER SECURITY TIER! </p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://www.linkedin.com/pulse/wifi-hacking-aircrack-ng-roy-bull-futaba-webs--bydbf/?trackingId=Zc1WbkyUSkampmjlJqWKuw%3D%3D" style = "text-decoration: none;"> <div class="d-grid">  </a>`;
