    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Women_Cyber" src = "Images/WhyWomenBelongInCyberSecurity.jpg" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "origin" style = "text-align: center; color: #D43F52;">Women were the first programmers and invented the first computing system ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The first programmer, and the first to develop the first computing system EVER, was by a woman named â€œAda Lovelace'' who invented the â€œanalyticalâ€ engine that theorized the main concept of numbers, â€œones and zeroesâ€ could be used for computing technology purposes other than just a mere â€œcalculatorâ€. Revolutionary, as it plays a vital role in how a computing system works on a binary level, using either a compiler or interpreter on behalf of a human readable programming language, to convert human readable instructions into code that a machine can understand. </p> </br></br> <h4 id = "cobol" style = "text-align: center; color: #D43F52;">COBOL, the first HUMAN programming language, was invented by a WOMAN ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Yes, you heard that right ladies and gentlemen, the first modern human readable programming language that involved converting human words into machine code was made by a woman, specifically, â€œGrace Hopperâ€. She personally taught MEN and WOMEN how to use the language, which revolutionized the accessibility of programming. No more punch card systems. Without her we wouldnâ€™t even have modern programming syntax that is mostly based on C.</p> <p></p> </br></br> <h4 id = "fulltime" style = "text-align: center; color: #D43F52;">The first full time paid programmers were Women ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Women were the first full time paid computer programmers, and were in charge of the ENIAC systems that relied on the punch card system. These systems were also responsible for bringing us to space via NASAâ€™s Apollo Project in 1969.</p> <p></p> <p>The sad tale to this is women were considered to be just â€œrefrigerator ladiesâ€ even though they played a major role in the advancement of computer technology which brought us to space. </p> </br></br> <h4 id = "space" style = "text-align: center; color: #D43F52;">Women took us to SPACE ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Yup, you heard that right! WOMEN TOOK US TO SPACE! A woman named â€œMargaret Hamiltonâ€ invented the â€œApollo Codeâ€ in 1969, which took us to space for the very first time! I LOVE THIS WOMAN SO MUCH I JUST WANT TO SHAKE HER HAND AND GET HER AUTOGRAPH. You think sheâ€™d sign my laptop? NOâ€¦. MY CODEâ€¦ SIGN MY CODE!!!! SIGN IT (remembers that this is an article and Iâ€™ve started nerding out).</p> <p></p> <p>I look up to this woman all the time and bring her up when I meet women that feel less encouraged to pursue technology.</p> </br></br> <h4 id = "wifi" style = "text-align: center; color: #D43F52;">THEY INVENTED AND PIONEERED MODERN WIFI, GPS, AND BLUETOOTH ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>A woman named â€œHedy Lamarrâ€, was the sole inventor and pioneer of wireless technologies: WiFi, Bluetooth, as well as modern GPS systems and the security implementation behind them. </p> <p></p> <p>This also influences any and all modern technical standards like IEEE which ensure the overall standard and security set in place for modern day wireless technologies. </p> <p></p> <p>Without her we wouldnâ€™t have cool wireless cards that hackers use to crack and pen-test against wireless standards and test their security.</p> <p></p> <p>We would also not have any form of satellite systems, microwave communication pipelines, GMS systems for cellular communication, etc, if she had not pioneered wireless technologies that are heavily implemented today. She plays one of the biggest roles in tech alongside â€œMargaret Hamiltonâ€ and â€œAda Lovelaceâ€.</p> </br></br> <h4 id = "need" style = "text-align: center; color: #D43F52;">Why we need more Women in Cyber Security ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>You can also check out these two sources if you wish to learn more about the history behind women in tech.</p> <p> <a href = "https://www.bricsys.com/en-eu/blog/computer-programing-a-brief-history" style = "text-decoration: none;">History Of Programing</a> </p> <p> <a href = "https://science.nasa.gov/people/margaret-hamilton/#hds-sidebar-nav-5" style = "text-decoration: none;">Margret Hamilton</a> </p> <p> <a href = "https://www.womenshistory.org/education-resources/biographies/hedy-lamarr" style = "text-decoration: none;">Hedy Lamarr</a> </p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://futabawebs.github.io/Articles/WhyWomenBelongInCyberSecurity" style = "text-decoration: none;"> <div class="d-grid">  </a>`;

