function MalwareArchetypes()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Women_Cyber" src = "Images/TheVirusArchetype.png" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "premise" style = "text-align: center; color: #D43F52;">Premise ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Sadly, because there are so many, I canâ€™t talk about all of them otherwise the article would be 7 pages long, so instead, Iâ€™ll talk about a select few.</p> <p></p> <p>If you would like to get more into malware development and learn a couple of projects, check out some samples on my GitHub page. Any and all code is well commented and documented, so you should have no trouble understanding what each line does. </p> <p></p> <p><a href = "https://github.com/RoyMBull/Python-Pen-Testing-Tools" style = "text-decoration: none;">My GitHub</a></p> <p></p> <h4 id = "malware" style = "text-align: center; color: #D43F52;">What is Malware? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Malware is any form of program that is designed for malicious reasons to infect and harm a system. It can come in many types and affect the system in various ways.</p> <p></p> </br></br> <h4 id = "poly" style = "text-align: center; color: #D43F52;">Polymorphic Virus ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Polymorphic viruses have the ability to mask their own code by means of encryption. This is a form of obfuscation technique that can also be used in order to avoid detection from various security systems, which can also allow the malware to command and control via communication with the bot master SECURELY. </p> <p></p> <p>As you know, computer systems, much like a human, are UNABLE to decipher data encryption. It comes up as garble to them. This allows the malware to remain invisible and not trigger any flags set by security systems.</p> </br></br> <h4 id = "armored" style = "text-align: center; color: #D43F52;">Armored Virus ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Armored malware focuses on defensive measures that make it hard to remove. A good example of this would be boot infector rootkits, that embeds itself in the master boot records of the system, proving to be fatal if you try to remove them.</p> <p></p> </br></br> <h4 id = "retro" style = "text-align: center; color: #D43F52;">Retrovirus ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Retroviruses are designed to neutralize any form of antivirus system set in place. They are the anti-virus for anti-virus. If you shut off any form of security system in place you basically CREATE a zero day where EVERYTHING goes undetected. </p> <p></p> </br></br> <h4 id = "phage" style = "text-align: center; color: #D43F52;">Phage Virus ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Phage Viruses, also known as â€œwormâ€ viruses, are standalone viruses that can operate independent of the person who wrote it. Itâ€™s typically used to infect various networks and run on its own, branching out. </p> <p></p> </br></br> <h4 id = "companion" style = "text-align: center; color: #D43F52;">Companion Virus ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>This is where Trojan malware comes from. Companion malware is designed to pose as legitimate software on the system, tricking the end user into executing it to compromise their system. It can be stuff like: RAT(Remote Access Trojan), MITB(Man-In-The-Browser), etc. This is a common form of malware that is even used in phishing tactics CONSISTENTLY. </p> <p></p> </br></br> <h4 id = "crypto" style = "text-align: center; color: #D43F52;">Crypto-Malware ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>This is Ransomware. Itâ€™s any form of malware that utilizes data encryption in order to compromise a system by enumerating the disk partitions and applying encryption at rest in order to render end user data infeasible, requiring them to pay a ransom in order to restore their data.</p> <p></p> </br></br> <h4 id = "hybrid" style = "text-align: center; color: #D43F52;">Hybrid Virus ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Hybrid malware, another common form of malware, focuses on combining several characteristic traits from other forms of malware.</p> <p></p> <p>This can be deadly, for example, if it were a worm virus that acts on itâ€™s own and can encrypt and protect itself, as well as re-write itâ€™s own code.</p> </br></br> <h4 id = "meramorphic" style = "text-align: center; color: #D43F52;">Meramorphic Virus ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>One of the HARDEST forms of malware to write, but EXTREMELY POWERFUL, this form of malware is able to re-write its own code, allowing it to adapt when needed. Think of this form of malware like â€œDarwinismâ€</p> <p></p> </br></br> <h4 id = "cavity" style = "text-align: center; color: #D43F52;">Cavity Virus ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>This is any form of malware that uses steganography tactics, which is commonly seen in Trojan malware. Steganography is the art of masking other data within other forms of data. </p> <p></p> <p>Here is a sample snippet of code, which you can copy and paste into a bash file and test out if you would like</p> <p></p> <p>The script can be found <a href = "https://github.com/RoyMBull/Bash-Shell-Scripting/blob/main/Bash%20Shell%20Scripting/Steganography.sh" style = "text-decoration: none;">here</a> in my bash repo</p> <p></p> <p>If you try to unzip this file on it's own while it's encoded, youâ€™ll notice that it doesn't work and it is registered as a â€œTEXT/ASCIIâ€ file type. If this were a system that does NOT allow zip folders to be uploaded, you can bypass security this way, and smuggle the malware in.</p> </br></br> <h4 id = "keylogger" style = "text-align: center; color: #D43F52;">Keylogger ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Keyloggers as the name would suggest, monitor all keys that are typed. This is typically used to POST data back to threat actor servers to steal sensitive information. </p> <p></p> </br></br> <h4 id = "spyware" style = "text-align: center; color: #D43F52;">Spyware ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Spyware monitors and collects data about various systems without the end-users knowledge/consent. This a form of stealth virus (Looks at Windows)</p> <p></p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://futabawebs.github.io/Articles/TheVirusArchetype" style = "text-decoration: none;"> <div class="d-grid">  </a>`;
 
}

function MobileHacking()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Mobile" src = "Images/Mobile Hacking.png" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "premise" style = "text-align: center; color: #D43F52;">Premise ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>For today's demonstration, Iâ€™m going to demonstrate how to hack into a Linux system using a meterpreter payload. Everything I am going to show here, carries over to the other platforms I mentioned since itâ€™s rinse and repeat. Iâ€™ll include any and all special commands that are tailored for mobile hacking while going over the exploit. </p> <p></p> <p>For this tutorial I highly recommend you check out my article on how to <a href = "https://www.linkedin.com/pulse/how-botnet-roy-bull-futaba-webs--2qnme/?trackingId=%2FTyiiJhMQueJsBUP3NAEGA%3D%3D&lipi=urn%3Ali%3Apage%3Ad_flagship3_pulse_read%3B%2FsNG5ns8TFCR4gpS64sgVw%3D%3D" style = "text-decoration: none;">botnet</a>, which covers a lot of the core basics on how to use the metasploit framework. </p> </br></br> <h4 id = "meterpreter" style = "text-align: center; color: #D43F52;">What is a Meterpreter Shell? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Meterpreter shell is a form of payload in the metasploit suite that allows an attacker to create a seamless backdoor. Each one tailors to a particular OS archetype and can be delivered in various ways. It also houses various custom command that allow you to: keylog a system, screen watch live, tap into camera feeds, etc. </p> <p></p> </br></br> <h4 id = "msfvenom" style = "text-align: center; color: #D43F52;">What is MsfVenom? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>MsfVenom is a tool apart of the metasploit site that is used to convert any and all payloads into an executable for any desired format that is needed. It also comes with encoding methods to obfuscate the payload so that it can avoid security systems that might recognize the signature of the payload. </p> </br></br> <img src="Images/counter.png" class="img-responsive" alt="portfolio img"> </br></br> <p> If you would like to see the more advanced version of this article that talks about methods that can be used to mitigate, as well as any videos included, SUBSCRIBE TO MY PATREON CYBER SECURITY TIER! </p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://futabawebs.github.io/Articles/MobileHacking" style = "text-decoration: none;"> <div class="d-grid">  </a>`;
}

