function Totsugeki()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Totsugeki" src = "Images/Totsugeki.png" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "premise" style = "text-align: center; color: #D43F52;">Premise ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Itâ€™s no speculation that a lot of the news surrounding it lately was going to lead to its inevitable ban in the U.S. The tool is so popular in regards to what itâ€™s being used for, that it could potentially be banned on a global scale, as itâ€™s also in the process of being banned in places like Canada that also see it as a threat.</p> <p></p> <p>For those that donâ€™t know, the Flipper Zero Tamagotchi is being used for motor vehicle car theft. The tool is so seamless and easy to use that even people that donâ€™t understand anything about hacking could pull it off, hence its ban being set into motion. Butâ€¦ What if I told you itâ€™s pointless to ban it? </p> <p></p> <p>I want to talk about why itâ€™s pointless to ban the Flipper Zero, as well as some basic things that could be done to prevent motor vehicle car theft with it, as well as other methods similar to it.</p> <p></p> <p>I also want to talk about how Cyber Security is a game of chess, and how it is meant to be played to deter Cyber threats. </p> </br></br> <h4 id = "flipperzero" style = "text-align: center; color: #D43F52;">What is the Flipper Zero? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The Flipper Zero Tamagotchi is a multi functioning tool that is able to intercept, clone, and replay various data communication methods specifically tailored to Radio/RF and RFID/NFC. This allows it to clone any form of authentication credentials that might pertain to the end user, allowing a threat actor to bypass security and access the system.</p> <p></p> <p>In simpler terms, itâ€™s able to clone the unique signature and data that is exchanged via remote control, such as a automobile car remote that unlocks the car door for you, or via RFID/NFC device tap, which exchanges data when you tap things like your ID badge to access a control room for example. It can even be simpler things like the NFC chips that are installed on our debit/credit cards, or our phones when we â€œtapâ€ it to make purchases on a regular basis or access various facilities like storage units. An attacker could use this to: break into your car, purchase things on your behalf, access control systems and authenticate as if they were you, and a lot more. The list goes on!</p> <p></p> <p>This technique is also what is known as a Replay Attack, which is commonly used to intercept crypto keys in order to perform a Wrapping Attack that allows an attacker to man in the middle and change the overall contents of the data that is being exchanged as if they were the original sender, while using the key to peek and do so each time.</p> <p></p> <p>If you ban the Flipper Zero then you have to ban every hacking tool that exists</p> <p></p> <p>There are a ton of hacking tools on the market, even ones from <a href = "https://shop.hak5.org/" style = "text-decoration: none;">Hack5</a> that also can do what the Flipper Zero does. To ban the Flipper Zero, means to ban all these tools as well. </p> <p></p> <p>Take For example the HackRF One which can also analyze RF frequencies for various purposes like the Flipper Zero and imitate them. Itâ€™s been around long before the Flipper Zero was ever made and it has yet to be banned. The only difference between the two, is that one is more accessible than the other. If thatâ€™s the case, then we need to upgrade our security so silly stuff like this DOESNâ€™T happen. Rule of thumb, IF A SCRIPT KIDDIE CAN PWN IT, ITâ€™S A PROBLEM!</p> <p></p> <p>Besides, itâ€™s easy to make your own Flipper Zero if you're skilled enough to do so. You can even name it whatever you want and bypass the ban. The Flipper Zero isnâ€™t anything we havenâ€™t seen before, itâ€™s just cute and popular!</p> </br></br> <h4 id = "lackofsecurity" style = "text-align: center; color: #D43F52;">Itâ€™s not the Flipper Zero, Itâ€™s our lack of Security ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The problem isn't the Flipper Zero, itâ€™s our lack of proper understanding of security practices that can be used to effectively neutralize the threat.</p> <p></p> <p>Itâ€™s no shocker that the implementation of Cyber Security practices are just now becoming a standard, with legal aspects cracking down HARD and punishing infrastructures for not implementing it, via fines and other means. This is because we are moving closer and closer to a more digital landscape where everything is connected, which is good news for hackers, since it extends the scope and range of what they can target now more than ever.</p> <p></p> <p>Security has been one of the many things ignored for far too long. Itâ€™s the main reason why we have so many security breaches. Most systems, even basic stuff like web applications, donâ€™t factor security in terms of overall design. Itâ€™s our job to ensure that anything and everything is properly secured regardless of what format said technology comes from. This also includes automobiles, which is the main topic for today since it relates to the Flipper Zero Tamagotchi.</p> <p></p> <p>The problem now is that we are just now catching up, while hackers have already done their homework and pretty much can stay ahead of the game. We need to do the same!</p> </br></br> <h4 id = "chess" style = "text-align: center; color: #D43F52;">Cyber Security Is A Game of Chess ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Cyber Security is a game of chess. What do I mean by that? I think the best example would be the classic one I provide a lot in my articles, my CTF server, <a href = "https://github.com/RoyMBull/Futabas_Playground" style = "text-decoration: none;">â€œFutabaâ€™s Playgroundâ€</a>.</p> <p></p> <p>When I made the CTF server I basically had to â€œplay this game of chessâ€, where I had to think several steps ahead of the player as they progressed throughout the game as if they were a â€œrealâ€ adversary. I had to think of all the possible variables of what the player could do to bypass my security and cheat the game.</p> <p></p> <p>For example, I ran into an issue where the player could easily access critical files on the server that would allow them to capture flags in unintended ways. This could easily be done via the browser, as well as ssh shells which are intended for the player to progress. This is a HUGE no go, so I needed to put a stop to that pronto. </p> <p></p> <p>My thought process to upgrade security was to figure out how to block easy web application access to the files, while also blocking ssh system command access to the files, and on top of this, I needed to make sure the server account hosting the web application could still read the files, while also ensuring the player could progress. Still with me? I know, this was a major headache for me too and took a lot of trial and error until I got it right!</p> <p></p> <p>The remedy for this was to: set the files on the server to ownership of the main account that reads it, that way only it and root users can access it. Root access can only be done on the final stage of the game, so by the time the player manages to get to all the files it will already be too late. See what I did there? I did a lot more, but of course, NO SPOILERS!</p> </br></br> <h4 id = "prevent" style = "text-align: center; color: #D43F52;">How to prevent automobile theft via the Flipper Zero (IN THEORY) ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>In theory, and itâ€™s quite simple, the best way to prevent automobile theft with the Flipper Zero is to implement the same methods that prevent Replay Attacks in general: splitting the data channels so that authenticated credentials to unlock the motor vehicle are not sent alongside each other. You can even layer frequency randomization on top of that much like with wireless access points to throw the tool off, that way it misses its target. These little things can hurt the effectiveness of the tool greatly.</p> <p></p> <p>I donâ€™t specialize in motor vehicle security, but Iâ€™m pretty sure there are a ton of other methods that can prevent the Flipper Zero from hacking into car systems. We just need to implement the security in place to do so!</p> <p></p> <p>If you have any other ideas that could improve motor vehicle security, feel free to drop your thoughts bellow in the comment section. Iâ€™d love to hear your own thoughts on the matter? </p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://futabawebs.github.io/Articles/Totsugeki" style = "text-decoration: none;"> <div class="d-grid">  </a>`;

}

function NotCyber()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;">  <img class = "img-thumbnail mt-4 Modal_Pic_NOT_Cyber" src = "Images/HowNotToBreakIntoCyber.png" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "technical"style = "text-align: center; color: #D43F52;">Ignore All Things Technical ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>There is a common misconception going around lately that you donâ€™t need to be technical to be in Cyber Security, a lot of which comes from faulty marketing schemes and training programs that prey on those that desperately wish to enter the field, selling them this false mindset that they can learn Cyber and land a job in a matter of 24 weeks with no technical background or formal training: IT, networking, programming, etc, all in order to make a profit.</p> <p></p> <p>This is highly unethical and NOT true, and sets people up for failure in the long run, which leads to a lot of missing talent that is needed in Cyber Security right now. This also leads to a lot of people taking a lot of shortcuts that set them back in the long run, making them underprepared to enter the field. </p> <p></p> <p>Regardless of what side you are on: red team, blue team, purple team, or the type of technology you help secure, you NEED to have a deep understanding of it if you truly wish to secure it. </p> <p></p> <p>If you are a red teamer, you need to understand how various core technologies work in order to exploit them. This allows you to find critical flaws in the system you are testing against so it can be properly secured. How can you exploit something when you donâ€™t understand how it works? Yes there are tons of tools, SQLmap for example, that can help red teamers pinpoint SQL injection vulnerabilities, but you still need to understand how SQL injection works on a fundamental level to use it properly. The tool is only as good as your fundamental understanding of the vulnerability it was designed to exploit. Not understanding how to find this type of vulnerability, even with the tool could cause you to miss critical vulnerabilities that did in fact exist, which can cause A LOT OF real world damage to an infrastructure if left unchecked.</p> <p></p> <p>If you are a blue teamer, you need to understand how core technologies work on a fundamental level so you can properly secure them. How can you secure something when you donâ€™t understand how it works? Take the CTF server I made for example, <a href = "https://github.com/RoyMBull/Futabas_Playground" style = "text-decoration: none;">"Futaba's Playground"</a>. It requires me to understand proper secure coding principles, as well as Linux system administration and configurations in order to properly secure the server. This prevents the player from bypassing any security for any and all challenges in unintended ways. I secured the server as if it were a real system from real threats, YOU, the player. If I wanted to take it a step further I can combine it with already pre-made tools and frameworks like SIEM and SOAR for example, that upgrade and smoothen the process for me depending on what I need it for. See where Iâ€™m going with this? </p> </br></br> <h4 id = "programming"style = "text-align: center; color: #D43F52;">YoU DoNt NeEd PrOgRAmMiNg FoR cYBeR sEcUrItY ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>I wrote an article a while back on why programming is crucial for Cyber Security. You can check that out <a href = "https://www.linkedin.com/pulse/why-programming-import-cyber-security-roy-bull-futaba-webs--sm80e/?trackingId=1l%2BRV%2FzwQUatieczffa%2Fig%3D%3D&lipi=urn%3Ali%3Apage%3Ad_flagship3_pulse_read%3BVEzx1nN%2FR3S024KklIANNg%3D%3D" style = "text-decoration: none;">here</a> if you would like to. For now, Iâ€™m going to talk a bit about forensics, one of the main fields in Cyber that people want to get into but REFUSE to learn how to code for. A lot of this is due to what I mentioned earlier, about people being sold the false notion they donâ€™t need to be technical to work in Cyber. You do need to be technical if you want to get into forensics. Forensics is crucial in that it stops the spread of malware should it pose a real worldwide threat. </p> <p></p> <p>Forensics, most of which involves a lot of reverse engineering and malware analysis, does in fact require you to know how to code, as well as be able to read it regardless of what programming language it might be in. Does it require you to understand how to program in every language and framework under the sun? No! But you do need to understand how code works, as well as the technology behind it under the hood. This also requires in depth technical knowledge about stuff like a debugger which allows you to trace binary code flow. </p> <p></p> <p>You need to understand how to write code so that you can replicate and/ or tamper with strains of malware you find. This allows you to cross test and find mitigations to secure against future malware infections. </p> <p></p> <p>You need to understand how to read code, regardless of whether or not it might be a language youâ€™re familiar with in order to dissect it. Sure, stick to malware in languages that you are familiar with, but often in the realm of Cyber Security, hackers are creative, and youâ€™ll often find unicorn-like malware or techniques that you didnâ€™t know about. You need to be able to adapt, and interpret it. Reading code is hard due to the nature of how sloppy and undocumented most code is written. You need to get comfortable with that and understand how to read and follow along core programming logic to understand how malware works. </p> </br></br> <h4 id = "networking"style = "text-align: center; color: #D43F52;">Networking and Building your brand ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>BUILD YOUR BRAND! BUILD YOUR BRAAANNND! I Canâ€™t stress this enough. The market for Cyber Security is HIGHLY competitive right now. You need to stand out. Even if you are a skilled professional, people need to know who you are. Remember, itâ€™s not about what you know (even though it is in Cyber), itâ€™s about WHO, you know. Even if you are a skilled professional, if no one is able to see what you can do, and itâ€™s not interactive then NOBODY CARES!!! Get used to that. Would you hire the nobody, or the somebody that has shown what they can do? Remember, this is a HIGH paying COMPETITIVE field, where places are looking to hire the best of the best. They are investing in YOU, to secure their systems, so donâ€™t disappoint! There are tons of skilled people, but not many that show off what they can do, and lose out to many that are unqualified due to poor marketing. All brain and no aim. </p> <p></p> <p>Take for example, my brand <a href = "https://linktr.ee/Futaba_Webs" style = "text-decoration: none;">Futaba_Webs</a>. Iâ€™ve been in the dark for a while now about my skill sets and was just mindlessly applying to jobs and hoping for the best. I wasnâ€™t networking or marketing myself so that professionals could engage with me and see my skill sets. This HURT me a lot, especially as someone that is self taught and cannot easily afford certifications. I have a lot of skill, most of which is â€œabnormalâ€ from the level I should be at professionally in case you havenâ€™t noticed. Despite what my resume says, Iâ€™ve been in tech for YEARS, and in each role, if you read closely, I was ALWAYS involved in some form of Cyber Security in each one. </p> <p></p> <p>The results I got? Constant connections flooding in, my brand going in the right direction, being asked to provide MORE mentorship and when I'll be doing it with a program I plan to announce soon <a href = "https://www.patreon.com/Futaba_Webs" style = "text-decoration: none;">here</a>, as well as being on the radar of high ranking and high level well established Cyber Security professionals. The results have been insane, and the support that has followed with it has been amazing as well. Iâ€™ve also been tagged in regards to large scale conferences and asked to speak at them, one I plan to do soon. </p> <p></p> <p>Even all of my articles and tutorials have been clever strategies to help advertise and sell my brand and get people to support my work so that they feel comfortable supporting my product I plan to launch soon which people have been asking for more of. People want to support you and aid you, but you have to PROVE you are legit. GET YOUR NAME OUT THERE NOW!!!!</p> </br></br> <h4 id = "selfdev"style = "text-align: center; color: #D43F52;">Say No to Self-Development ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>If you donâ€™t like having to constantly learn and adapt, then maybe this isnâ€™t the field for you. In case you havenâ€™t noticed, Cyber Security is an ever evolving landscape, where threats are constantly evolving. You need to stay in the loop on new technologies and methods hackers use to breach systems. This information alone allows us to improve our overall security infrastructures and keep them safe. Refusing to adapt is like refusing to update from Windows XP to the latest firmware. You pick up what Iâ€™m putting down? </p> </br> </br></br> <h4 id = "communication"style = "text-align: center; color: #D43F52;">Communication Skills Are Over Hyped ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Trying to sell CyberSecurity products and spread security awareness? Part of the reason no one takes their security practices seriously is due to the lack of understanding of it, and how itâ€™s explained. Notice how ALL of my articles I go into FULL detail and break technical concepts down to their simplest form, with examples that are easy to understand while still retaining their core technical aspects. Notice how this entire article Iâ€™ve essentially done the same thing, while still being technical but not TOO technical. You understand? Good! </p> <p></p> <p>You need to be mindful that not everyone is technical and some people need it to be explained to them in simpler terms. COMMUNICATION IS KEY!</p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://futabawebs.github.io/Articles/HowNotToBreakIntoCyber" style = "text-decoration: none;"> <div class="d-grid">  </a>`;

}

function CyberMentor()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Mentor" src = "Images/HowtofindaCyberSecurityMentor.png" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "premise" style = "text-align: center; color: #D43F52;">Premise ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Iâ€™m also going to dive into a sensitive topic as to why itâ€™s hard to find a mentor, as well as the general etiquette and relationship dynamic between mentor and mentee. This is to help show you the doâ€™s and donâ€™ts when looking for one, as well as how to maintain one should you happen to find one. Mentors, GOOD ones, are HARD to find, so if you happen to land one, MAINTAIN IT! </p> <p></p> <p>Iâ€™m also going to address the BIG dangers of free learning and why it doesn't work for everyone. This will better establish the main reason why people still seek mentorship even though they can learn for FREE at NO COST on their own.</p> <p></p> <p>This article is made specially after the announcement of a hybrid mentorship program that Iâ€™m working on that will be available soon! You can check out the details on my linktree <a href = "https://linktr.ee/Futaba_Webs" style = "text-decoration: none;">here</a> if you would like! MORE COMING SOON FOR IT! </p> </br></br> <h4 id = "mentor" style = "text-align: center; color: #D43F52;">The role of a Cyber Security Mentors ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Cyber Security mentors are the people with experience that lead and guide the next wave of people that are seeking to enter the field. They are your teachers, and like all teachers, are CRUCIAL in order to build up your repertoire of knowledge needed to succeed in your field. They help guide you through all the stuff you need to know and filter out the stuff you donâ€™t need to know. They also help you figure out your main interest, and narrow the skill sets you need to learn in order to succeed. They also help you develop the proper critical thinking skills that are needed to succeed in your field as well. </p> </br></br> <h4 id = "part1" style = "text-align: center; color: #D43F52;">Why is finding a mentor so hard? (Part 1) ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>One of the biggest reasons why itâ€™s hard to find a mentor is due to the shady intentions that come from most people in the Cyber Security field. Itâ€™s not news by now that a lot of people in Cyber are just looking to sell you false hopes and dreams, empty promises that are just a mere cash grab. LEARN CYBER SECURITY IN 24 WEEKS AND MASTERâ€” You pick up what Iâ€™m putting down right?</p> <p></p> <p>Not everyone has the best intentions for you, and some, quite franklyâ€¦ even those that have been in the field for years with a shiny titleâ€¦ Donâ€™t know their stuff and THEY are the ones that are holding the high level certs and positions.</p> <p></p> <p>You need to also be mindful, THERE IS A LOT OF GATEKEEPING in this field. People are willing to lead others down the wrong path if it means they keep you out and or get in. If youâ€™re looking for a mentor, make sure you check their credibility and look into them before you check in for services with them. I recommend looking for mentors that are SHOWING you what they know vs ones that HIDE all of their stuff. YouTube content creators like Rana Khali, who now runs her own academy is a classic example of someone that has established solid credibility and trust that you can look into if you need mentorship. </p> </br></br> <h4 id = "part2" style = "text-align: center; color: #D43F52;">Why is finding a mentor so hard? (Part 2) ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Much like how not all mentors have the best of intentions, the same can also be said for mentees. </p> <p></p> <p>Mentees, for those that do not know, have been known to take advantage of their mentors, especially the free ones who are commonly sought after. A lot of this is due to a sense of entitlement and them using any means to get in, even if they have to exploit their fellow learners and mentors in the process. Not everyone is looking to win with you so you need to be mindful of that!</p> <p></p> <p>A lot of people, and Iâ€™m sorry to even have to say this, belittle mentors, specifically ones that help for free. Some even ghost their mentors after they help them land a job. Itâ€™s these very critical reasons why free mentors are stepping away, most charging you now for their time. People don't want to be taken advantage of. </p> <p></p> <p>This also explains the main reason why people arenâ€™t very â€œfriendlyâ€ when you DM them and ask them for tips and tricks, and why if you do get a â€œfreeâ€ answer, it's rather vague.</p> <p></p> <p>For me personally, it is the main reason why I have rejected EVERY SINGLE person that has asked for free mentorship thus far. All it takes is for ONE bad cookie, and it has a rippling effect. </p> </br></br> <h4 id = "mentorable" style = "text-align: center; color: #D43F52;">Are you Mentorable? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Most people sadly arenâ€™t mentorable. More times than none, as someone that mentors consistently, PEOPLE DO NOT LISTEN TO THEIR MENTORS! If you are going to seek mentorship LISTEN TO THE PROFESSIONALS advice, especially if it comes from one that is highly credible.</p> <p></p> <p>People are looking for shortcuts to get in, and when they find out there arenâ€™t any, and they have to do and learn the thing, they bail out and stop listening to their mentor, thinking they are trying to mislead them. THEY ARENâ€™T, AND YOU NEED TO LISTEN TO THEM, otherwise you are just setting yourself back, and wasting everyoneâ€™s valuable time!</p> </br></br> <h4 id = "notrecruiters" style = "text-align: center; color: #D43F52;">MENTORS ARE NOT RECRUITERS! ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Mentors are NOT recruiters. Itâ€™s not their job to land you a role, thatâ€™s YOUR job, as well as the job of a recruiter. </p> <p></p> <p>People often leave their mentorships due to not securing a role, because they have the impression that their mentor is responsible for that. They donâ€™t owe you that nor should you expect that from them, especially if they are trying to help you for free. </p> <p></p> <p>They are there to guide/teach you how Cyber Security works so that you build up the skill sets needed to succeed in this field. Itâ€™s YOUR job to decide what you do with that knowledge. No one is responsible for your success but you!</p> </br></br> <h4 id = "communication" style = "text-align: center; color: #D43F52;">Communication is KEY! ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Keep in touch with your mentor! Itâ€™s CRUCIAL! As Iâ€™ve mentioned before, there is a lot of ghosting going around lately towards mentors that put in a lot of time to help their mentees, especially ones that do so for FREE. Respect their time and keep in touch!</p> </br></br> <h4 id = "personal" style = "text-align: center; color: #D43F52;">Keep your personal feelings outside of your mentorship ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>I cannot stress this enough, and this also applies to the real world in general, NO ONE IS RESPONSIBLE FOR YOUR PERSONAL PROBLEMS. Donâ€™t take your personal issues out on your mentor. They are here to help you! Itâ€™s your job to stay in touch and give that bit of communication in case something does happen so they can understand. People canâ€™t understand you if you donâ€™t communicate! </p> <p></p> <p>RESPECT YOUR MENTORS!</p> </br></br> <h4 id = "free" style = "text-align: center; color: #D43F52;">Do you want FREE learning or FREE Mentorship? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>A lot of people think that the thing they want is FREE learning, but itâ€™s not, itâ€™s free mentorship and guidance which no one owes you! </p> <p></p> <p>Teaching yourself anything from the ground up is possible, but itâ€™s EXTREMELY HARD! There is no one to guide you or explain the stuff you need to know. YOU ARE ON YOUR OWN.</p> <p></p> <p>Iâ€™ve been self taught for about 11 years now and I reassure you, figuring out where I had to go for Cyber was hard. I was running around in circles trying to figure stuff out. I wasnâ€™t able to find a Cyber mentor due to all the things that Iâ€™ve mentioned, which is why I put so much effort into it. PEOPLE NEED MENTORS!</p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://futabawebs.github.io/Articles/HowtofindaCyberSecurityMentor" style = "text-decoration: none;"> <div class="d-grid">  </a>`;

}

function Persona()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Hats" src = "Images/HackingPersona.jpg" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "premise" style = "text-align: center; color: #D43F52;">Premise ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Iâ€™m going to go over the various types of hackers, or â€œhatsâ€ to be more specific. There are seven types: white, black, gray, green, blue, red, and purple. Each hat has an agenda and purpose and plays a HUGE role in protecting our digital landscape.</p> <p></p> <p>I'm also going to go over what a script kiddie is since there is A HUGE difference between them and one particular hat that is apart of the main category that is going to be discussed today.</p> <p></p> <p>Youâ€™ll also get more in depth as to why my head line says I am a â€œGray Hat Hackerâ€. A lot of people, and Iâ€™ve talked with a few, have no idea what the hatâ€™s actually stand for and why we use them. </p> <p></p> <p>Itâ€™s important, especially if you are going to be a part of hacker culture. It will come up in topics, so itâ€™s best you know what they all stand for. </p> </br></br> <h4 id = "white" style = "text-align: center; color: #D43F52;">White Hat Hackers ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>White hat hackers are basically the good guys, the Cyber Security professionals that help defend various system and business infrastructures, as well as being responsible for the very security that is implemented in them as well. Without them, there would be no form of security in any and all forms of technology, and we would all be exposed to various threats. This is why â€œCyber Securityâ€ exists. If you are in Cyber Security, then by default you are a white hat hacker, unless you identify otherwise. </p> <p></p> <p>They are also penetration testers that focus on exploiting a system in order to find vulnerabilities in a system, reporting it so that the side that defends can mitigate the threat so that real threat actors are unable to take advantage of it. This is typically done in the fashion of finding the flaw in the system before someone else does. </p> <p></p> <p>This hat is split into 2 unique categories, that Iâ€™m pretty sure you might already be familiar with, red team and blue team. </p> <p></p> <p>Red teamers, are the offensive security professionals like penetration testers for example who attack to find weaknesses in the system, and report them. </p> <p></p> <p>Blue teamers, are the defenders, who specialize in the core implementation of security remedies that help protect system infrastructures, as well as being first responders to various security breaches that occur within business infrastructures. </p> <p></p> <p>Each team has their own set of specialties and roles that dive deeper into the matter of what they do, but I'll leave that for another article explaining the both of them, so you can get a better idea of where you might want to start out in Cyber Security. </p> </br></br> <h4 id = "black" style = "text-align: center; color: #D43F52;">Black Hat Hackers ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>These are the bad guys, legit threat actors that seek to exploit a system for personal game: money, data, fame, etc. Unlike white hat hackers who have major restrictions and limitations on what they can and canâ€™t do when conducting an official penetration test, black hat hackers donâ€™t have this restraint. They exploit systems in any and all various ways, which is why we have to keep evolving our mitigation tactics in order to neutralize cyber crime. They are the main reason we are in an ever ending fight to protect the digital landscape. </p> <p></p> <p>They also tend to operate on places like the dark web, providing illegal services from various means based on their skill set. </p> </br></br> <h4 id = "gray" style = "text-align: center; color: #D43F52;">Gray Hat Hackers ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>White hat hackers are basically the good guys, the Cyber Security professionals that help defend various system and business infrastructures, as well as being responsible for the very security that is implemented in them as well. Without them, there would be no form of security in any and all forms of technology, and we would all be exposed to various threats. This is why â€œCyber Securityâ€ exists. If you are in Cyber Security, then by default you are a white hat hacker, unless you identify otherwise. </p> <p></p> <p>They are also penetration testers that focus on exploiting a system in order to find vulnerabilities in a system, reporting it so that the side that defends can mitigate the threat so that real threat actors are unable to take advantage of it. This is typically done in the fashion of finding the flaw in the system before someone else does. </p> <p></p> <p>This hat is split into 2 unique categories, that Iâ€™m pretty sure you might already be familiar with, red team and blue team. </p> <p></p> <p>Red teamers, are the offensive security professionals like penetration testers for example who attack to find weaknesses in the system, and report them. </p> <p></p> <p>Blue teamers, are the defenders, who specialize in the core implementation of security remedies that help protect system infrastructures, as well as being first responders to various security breaches that occur within business infrastructures. </p> <p></p> <p>Each team has their own set of specialties and roles that dive deeper into the matter of what they do, but I'll leave that for another article explaining the both of them, so you can get a better idea of where you might want to start out in Cyber Security. </p> </br></br> <h4 id = "red" style = "text-align: center; color: #D43F52;">Red Hat Hackers ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Now, you might have heard the term red hat before, typically when it applies to the Linux version, but did you know, itâ€™s ACTUALLY a real hat for us? </p> <p></p> <p>Red hat hackers are a white hat hackers that hunt down black hat hackers. In case you haven't noticed, black hat hackers arenâ€™t well received.</p> </br></br> <h4 id = "green" style = "text-align: center; color: #D43F52;">Green Hat Hackers ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>For those of you who are new to hacking, this would be where you currently lay.</p> <p></p> <p>Green hat Hackers are newcomers that are honing their skills. </p> </br> </br></br> <h4 id = "script" style = "text-align: center; color: #D43F52;">Script Kiddies ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>NOT to be confused for a green hat, who actually knows a thing or two about hacking, script kiddies are hackers, if you could call them that, that rely on someone else's tools and techniques without proper understanding to hack people. </p> <p></p> <p>The good news about these types of hackers is they will ALWAYS be predictable and are easy to counter and neutralize. </p> </br></br> <h4 id = "blue" style = "text-align: center; color: #D43F52;">Blue Hat Hackers ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>A common trick that a lot of people like to use in order to prevent unauthorized network breaches, is they like to hide their SSIDâ€™s which is the name of the network. This is effective in that you can hide SSID information from common means of exposure, like the GUI you use when selecting a wireless access point to communicate with.</p> <p></p> <p>The problem with this is it can easily be bypassed by the same method mentioned in option #2 of how to bypass MAC address filtering. </p> <p></p> <p>Your SSID is also broadcasted along with any and all MAC address information that is sent out in data packets. They have to be, otherwise our IoT devices would be unable to pick them up and identify them. THERE IS ALWAYS A WAY TO BYPASS ANYTHING! NOTHING IS 100 PERCENT SECURE!</p> <p></p> <p>Todayâ€™s positive bonuses will focus more on how to defend against MAC address filtering bypasses, preventing an attacker from breaching the network via this security method.</p> </br></br> <h4 id = "purple" style = "text-align: center; color: #D43F52;">Purple Hat Hackers ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>These hackers are basically revenge hackers, or in a sense, suicide hackers depending on the situation. </p> <p></p> <p>They can also be script kiddies and or new hackers that are taking revenge on someone else.</p> <p></p> <p>They can also be white hat hackers, or disgruntled employees that have gone rogue, which can pose a real threat especially when itâ€™s from inside the main infrastructure. </p> <p></p> <p>This term can also be for hackers that are contractors, invited to test for security flaws within software products that have yet to be released. They are hired based on their reputational value.</p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://futabawebs.github.io/Articles/HackingPersona" style = "text-decoration: none;"> <div class="d-grid">  </a>`;
}

function DangerMobile()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_DangerMobile" src = "Images/DangerMobileDeviceSecurity.png" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "premise" style = "text-align: center; color: #D43F52;"">Premise ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>This article topic was inspired from a recent thread I was in where a womanâ€™s mobile device got hacked and it led to various parts of her life being compromised in the process, putting her overall safety as well as that of her friends and family at risk! I wanted to raise more awareness and teach people how to protect their digital identity! A lot of the article will be me addressing what happened, as well as remedies I gave her to protect herself.</p> <p></p> <p>This is also the start of a new series that is called the â€œDANGER!â€ series, where I raise more Cyber Security awareness about critical flaws and vulnerabilities within system infrastructures, including any protocols and data communication methods, where I also talk about mitigation strategies that can be used to prevent such threats.</p> <p></p> <p>There will also be a LIVE demonstration for those of you who are subscribed to my patreon, to see how closely I can exploit mobile end devices in order to retrieve any and all sensitive data from the mobile end device! There will also be a step by step exploit guide walking you through the entire process as well, and how to gelocate someoneâ€™s phone and turn it into a GPS tracker!</p> </br></br> <h4 id = "connected" style = "text-align: center; color: #D43F52;">NEGATIVE PENALTY! Everything is connected ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>One of the biggest things about technology is that EVERYTHING is connected. When isn't something going online? Even stuff like electric toothbrushes are being connected to the internet. We also have stuff like smart homes and other various means of smart technology that make our lives easier. </p> <p></p> <p>The problem with all of this is that it also makes life easier for Hackers. Everything being connected extends the main scope and attack surface for them, allowing threat actors to further exploit systems in various ways. We are in a sense creating our own colossal monolithic structure where everything is both connected and further dependent on each other, which can be lethal in VARIOUS ways! </p> <p></p> <p>What do I mean by this? Well, for starters, letâ€™s say that a hospital system that contained a multitude of life support systems were connected online and to various networks. What would happen if a threat actor with ill intentions breached the network? </p> <p></p> <p>If an attacker were to breach it, they would essentially be able to play GOD, controlling the entire system and being able to choose whether or not actual Lives were lost. If they wanted to, they could shut down all the power systems, even the backups since a lot of this stuff seems to be connected nowadays, killing EVERYONE on life support in the process.</p> <p></p> <p>Another example, would be the woman whose mobile device I talked about was breached, allowing the attacker to control her entire mobile phone and anything she gave it access to: smart home tech, Bluetooth devices, sessions that she had on, etc. The hacker was also able to ruin her credit as a lot of her personal information and files were on the system, and they happened to gain access to that as well, even sensitive contacts and messages that were directly on her phone. One little device cost her EVERYTHING and put her and the people she cares about at risk!</p> <p></p> <p>This also gets scary because, letâ€™s say that her phone was used to authenticate to anything within an organization that she worked for. It would lead to a massive scale breach. A lot of infrastructures are still new to solid Cyber Security practices so things like this DO happen!</p> <p></p> <p>If they wanted to spoof her and do spear phishing, like Iâ€™ve mentioned, they have access to ALL of her contacts and can pull up that information. They can even spoof her number and do all sorts of nasty stuff with it, like bypassing any and all MFA she has on the phone, allowing them to even do scary stuff like wiring themselves money out of her bank account. </p> </br></br> <h4 id = "traced" style = "text-align: center; color: #D43F52;">NEGATIVE PENALTY! You can be traced! ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Your phone is a walking GPS locator! If your phone gets hacked YOU ARE IN DANGER!</p> <p></p> <p>One of the scariest things the woman that got hacked didnâ€™t realize.. WAS SHE WAS NOW A WALKING GPS target for them to find anytime they needed to. This meant that anytime she was around friends or family, their address and location information, or should she even connect to their home network, COULD ALL BE TRACED AND COMPROMISED in one go. She was basically a walking botnet they could command and control all in one go. </p> <p></p> <p>For many that do not realize this, your phone is connected to a cellular network via a sim card that is attached to it, allowing it to connect to the cellular network, which provides you with a private IP address that is then converted to a PUBLIC IP address that can be used to allow you to connect to the internet from your phone. </p> <p></p> <p>This means that if an attacker wanted to, they could secure your POSSIBLE location regardless of where you are as you ALWAYS tend to have your phone on you! Hackers can exploit this and ping your every move! Even if this method is debunked it's still possible to trace you with the device via other alternatives. I ran a few tests with this. If someone were to breach your device and you were connected to a personal network, such as your home network it would also be highly possible for them to ping your location since it's connected to your home network as well. You also have to keep in mind there are apps on your phone that give your location details away since you give the permission to collect that from you depending on the application.</p> </br></br> <h4 id = "hijacking" style = "text-align: center; color: #D43F52;">NEGATIVE PENALTY! Session Hijacking/MFA bypassing ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Your mobile device is one of the greatest forms of session hijacking. Session hijacking is where you are able to breach a victim's system and â€œuseâ€ any sessions that are currently in progress on them. </p> <p></p> <p>For example, your Facebook session. If you tell Facebook to keep you logged in, it will generate a cookie that can be used to remember your session and progress, which you can pick up on even if youâ€™ve powered the system on and off. This can be critical and fatal, since an attacker could exploit this should you leave your system unattended anytime in order to do stuff like: wire themselves money via Facebook pay, change your credentials, access sensitive conversations and pretend to be you, etc, and since this is on your mobile device they will of course have access to the various means to bypass MFA on your mobile device!</p> </br></br> <img src="Images/counter.png" class="img-responsive" alt="portfolio img"> </br></br> <p> If you would like to see the more advanced version of this article that talks about methods that can be used to mitigate, as well as any videos included, SUBSCRIBE TO MY PATREON CYBER SECURITY TIER! </p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://futabawebs.github.io/Articles/DangerMobileDeviceSecurity" style = "text-decoration: none;"> <div class="d-grid">  </a>`;

}

function FoxyProxy()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_FoxyProxy" src = "Images/FoxyProxy.jpg" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "premise" style = "text-align: center; color: #D43F52;">Premise ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>There will be live video demonstrations of course, but like always, that is for the PAID patreon members. Iâ€™m also going to show you how to botnet and command and control with the burp suite proxy server and how to strip any and all network traffic on a multitude of systems using it! </p> </br></br> <h4 id = "burp" style = "text-align: center; color: #D43F52;">Burp Suite Proxy Server ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The burp suite proxy server is used to intercept and analyze network traffic and handle it in various ways. It is one of the most commonly used tools when testing against OWASP vulnerabilities within web application systems. THIS IS A STAPLE TOOL THAT YOU MUST KNOW HOW TO USE!</p> <p></p> <p>It can be used either for defense or for offense. In our case, we are going to talk about how it applies to offensive capabilities.</p> </br></br> <h4 id = "proxy" style = "text-align: center; color: #D43F52;">Proxy mode ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Burp suite has a feature in it that is called Proxy mode, where you can focus the tool on intercepting various network data communication methods. </p> <p></p> <p>With this particular method, youâ€™ll be able to boot up a dummy browser session that can be used to test and track any communications that you personally send to a web application host target. Burp suite uses selenium in order to craft a test chromium browser session. </p> <p></p> <p>Why for yourself? Well, for starters, you can use the tool to gather in depth information on all the parameters and HTTP headers that are being sent to a target. You also have the ability to manipulate them and control how the server side will respond to you. Itâ€™s how hackers tend to test various fuzzing methods that will allow them to bypass security and exploit a system.</p> <p></p> <p>You can also use this feature to analyze any and all main scripts that are on the page, and follow network traffic as it pivots within the main internal, as well as any external domains that the tool might catch. </p> </br></br> <h4 id = "foxy" style = "text-align: center; color: #D43F52;">Foxy Proxy Mode (Firefox extension) ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Now, this isnâ€™t an exact feature that is a part of the main burp suite tool set, BUT, Firefox has a dedicated extension that allows you to set up a main proxy server on a system in order to forward all traffic to a main proxy server you have in a listening state.</p> <p></p> <p>This means that for an attacker, if we wanted to, and if we got creative, WE CAN BOTNET USING BURP SUITE. You can sit this on your system on a network, configure the extension on any and all systems on the network as well as the proxy server itself, and then BOOM, you can strip any and all network traffic, deciphering any and all credentials you can intercept.</p> <p></p> <p>You can also get creative and configure burp suite as a main proxy server within the network settings of the system you are looking to infect. </p> </br></br> <h4 id = "intruder" style = "text-align: center; color: #D43F52;">Intruder Mode ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>This mode is used for brute force based attacks, where you can send network traffic from the main HTTP socket history, and then handle it to inject word list points in them to have the tool brute force against. You can even set up the tool to allow stuff like pitch force brute forcing which is used to test against login time outs to bypass brute force protection on a main system.</p> </br></br> <h4 id = "repeater" style = "text-align: center; color: #D43F52;">Repeater Mode ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Remember how I said that the burp suite tool can be used to manipulate the HTTP parameters and other information that is sent in the main request from client to server?</p> <p></p> <p>This mode allows you to do just that, store, modify, and repeat until you get a desired response form the server. This is crucial in case you wish to do stuff like SQL injection or RCE, and you need to see additional information that isn't shown to you from the main GUI of the site page. </p> </br></br> <h4 id = "decoder" style = "text-align: center; color: #D43F52;">Decoder Mode ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>This IS YOUR BREAD AND BUTTER IF YOU ARE FUZZING. What this mode allows you to do is type and encode as you need to, as well as being able to decode in case you need it to do so as well. </p> <p></p> <p>Let's say for example, you found a critical flaw in a system that allows you to RCE a server, but it doesn't allow white spaces or certain characters. It can be tricky jumping back and forth between an online encoder to handle the process for you. You can use this tool to handle all of that for you and craft a clean exploit if you need to inject some code into the target.</p> <p></p> <p>These are some of the basic core features and how they work for now. If you would like a more detailed version with live video examples and showcases on how to use the tool, then check out my patreon in order to get all of that juicy information. You get a lot of goodies for subscribing and a lot more quality content. </p> </br></br> <img src="Images/counter.png" class="img-responsive" alt="portfolio img"> </br> </br> <p> If you would like to see the more advanced version of this article that talks about methods that can be used to mitigate, as well as any videos included, SUBSCRIBE TO MY PATREON CYBER SECURITY TIER! </p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://futabawebs.github.io/Articles/FoxyProxy" style = "text-decoration: none;"> <div class="d-grid">  </a>`;

}

