function DanngerSSO()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_SSOOpen" src = "Images/DangerSSOAndOpenAuth.jpg" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "premise" style = "text-align: center; color: #D43F52;">Premise ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>For the sake of the argument, I will be focusing on the initial main premise of the two, and NOT advanced versions of them which have received some security upgrades for obvious reasons. I want to focus more on talking about the overall design of the two methods and the BIG flaws in them.</p> <p></p> <p>This article is a part of the new Danger! Series Iâ€™m launching, which is where I raise more Cyber Security awareness about critical flaws and vulnerabilities that exist within various system infrastructures, including any protocols and data communication methods, and the Dangers of what could happen should they be exploited to the fullest extent. I also go over various mitigation strategies that can be used to prevent them as well. If by chance there is an exploit video for me showing the full potential risk, it will be included in the advance version of this article for PAID patreon members only!</p> <p>As always, any and all advanced versions of this article with a video guide if given will be for PAID patreon members only!!</p> </br></br> <h4 id = "accessibility" style = "text-align: center; color: #D43F52;">Accessibility vs Convenience in Cyber Security! ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>One of the biggest challenges we face when implementing new security features in an infrastructure is accessibility vs convenience, the overall means to implement a new security method while also making it convenient to use. </p> <p></p> <p>Accessibility allows the end user to easily understand and interpret/apply the new approach to security, allowing it to be seamlessly implemented into the security infrastructure in various ways. </p> <p></p> <p>This in return would require it to be more convenient in order to make it more accessible to them. Take token based MFA for example. All it is, is a simple pin code that is sent to the end user, so that they can input it into a system and authenticate on top of pre-existing knowledge factors that are set in place by default. For the sake of convenience, we have it set up so that the end user can receive the code in a variety of different ways: mobile SMS messages, email, authenticator apps, etc etc, various means spread out to allow them to use the method, which in the process, also makes it more accessible for them.</p> <p></p> <p>Sounds harmless right? WRONG. By making the method more convenient and accessible, we in fact increase the overall attack surface, making it more convenient and accessible for hackers to have options in order to exploit the security method that weâ€™ve introduced. Donâ€™t believe me? Check out my <a href = "https://www.linkedin.com/pulse/danger-your-mobile-devices-vulnerable-roy-bull-futaba-webs--9u54e/?trackingId=OXrHkoIFT7mk8EkVhAcJkA%3D%3D&lipi=urn%3Ali%3Apage%3Ad_flagship3_pulse_read%3B7CUpqjxKRHaRgkH5R2N%2BAA%3D%3D" style = "text-decoration: none;">â€œDANGER!Your Mobile Devices are VULNERABLE!â€</a> article to learn about how one of these endpoints allows attackers to easily bypass the security method if needed. This of course, like all forms of MFA, varies depending on the layers that are within it. Iâ€™m of course ONLY talking about scenarios that involve the pin code method.</p> <p></p> <p>We need to be mindful that when implementing other endpoints for accessibility that can also apply the security method, we need to think several steps ahead, stuff like â€œis said endpoint secure enough to handle this feature?â€, â€œwhat would happen in the event that itâ€™s compromisedâ€. We consistently get full of ourselves, thinking that the implementation of the method itself will suffice, that it is impenetrable, yet overlook the stuff like this, weaknesses that can turn it into rumble. </p> <p></p> <p>In terms of overall convenience, as harsh as this may sound, sometimes you need to limit how convenient it is to apply the method in order to ensure it's not easily exploitable. This can include from a wide range of stuff like either limiting how the user applies it, or, I some cases, how often the end user is required to use it, which leads into stuff like "Zero-Trust", which is a complex, yet secure form of security for any system infrastructure. I'll talk about that in another article. For now, let's stick to the main topic. </p> <p></p> <p>You can still make it more accessible and ensure that end users are able to use and implement it, but not TOO accessible if you see my main point? </p> </br></br> <h4 id = "argument" style = "text-align: center; color: #D43F52;">Where am I going with this argument? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Now, how does all of this apply to the topic up for discussion today? Well, believe it or not, SSO and OpenAuth, the main topic for today, as funny but not funny as this might sound, were MADE TO BE MORE CONVENIENT THAN IT IS SECURE. Don't believe me, well let me walk you through the overall concept of how these authentication methods function so that you see the point Iâ€™m trying to make. </p> <p></p> <p>Now, just to be CLEAR, I am NOT saying that whoever made this form of authentication method had the intention of NOT making it secure. I am simply just pointing out the major weaknesses in them based on how they were originally designed.</p> </br></br> <h4 id = "sso">What is SSO (Single Sign On) ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Single sign on is the overall concept of being able to use ONE set of credentials to authenticate and log into multiple sessions with the same credentials that were used to authenticate to the first. Typically itâ€™s used in infrastructures that have multiple sub layers or services that you would need to authenticate to. A good example of this would be WGUâ€™s school system that deploys this method in order to allow you to authenticate to even your outlook mailbox with just your one session that you sign into the main student portal. </p> </br></br> <h4 id = "openauth" style = "text-align: center; color: #D43F52;">What is OpenAuth ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>This is a new form of authentication that is supposed to make sending over credentials a thing in the past, allowing you to basically send over passwordless credentials and authenticate to a system. This can also be done through mutual trusting parties such as the "Sign in with Google" option that you see on a lot of web applications that let you use your google log in session to authenticate.</p> <p></p> <p>This means that in theory if an attacker were to intercept a communication pipeline they would end up with nothing.</p> <p></p> <p>This method sounds lovely on paper, HOWEVER, there is one HUGE downfall to thisâ€¦ and why it needed some umâ€¦ fixes cough requiring older security methods to patch it. It's one of the largest forms of a security breach waiting to happen. As a matter of fact it already has been. You can check a scenario on where OpenAuth is being used maliciously right <a href = "https://www.microsoft.com/en-us/security/blog/2022/09/22/malicious-oauth-applications-used-to-compromise-email-servers-and-spread-spam/" style = "text-decoration: none;">here</a> in order to infect and breach systems.</p> </br> <img src="Images/counter.png" class="img-responsive" alt="portfolio img"> </br></br> <p> If you would like to see the more advanced version of this article that talks about methods that can be used to mitigate, as well as any videos included, SUBSCRIBE TO MY PATREON CYBER SECURITY TIER! </p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://futabawebs.github.io/Articles/DangerSSOAndOpenAuth" style = "text-decoration: none;"> <div class="d-grid">  </a>`;

}

