function DangerSSID()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_CookieSession" src = "Images/DangerSSIDMACFILTERING.jpg" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "premise" style = "text-align: center; color: #D43F52;">Premise ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>This article is a part of the new Danger! Series Iâ€™m launching, which is where I raise more Cyber Security awareness about critical flaws and vulnerabilities that exist within various system infrastructures, including any protocols and data communication methods, and the Dangers of what could happen should they be exploited to the fullest extent. I also go over various mitigation strategies that can be used to prevent them as well. If by chance there is an exploit video for me showing the full potential risk, it will be included in the advance version of this article for PAID patreon members only!</p> </br></br> <h4 id = "overeliance" style = "text-align: center; color: #D43F52;">Over reliance on one set of tools or methods is a PROBLEM! ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>One of the biggest flaws in today's modern Cyber Security is the over reliance on a set of security methods/tools that one assumes is FULL PROOF secure with ZERO weaknesses. </p> <p></p> <p>This leads to us letting our guard down, not planning further ahead on the various ways hackers could bypass our various security methods: technical, physical, and operational, preventing us from developing contingency plans that could back us up in case said series of options fail. Cyber Security, as Iâ€™ve said before, is a game of chess, one that requires you to be several steps ahead in order to defend our digital landscape. </p> <p></p> <p>For one to assume there is no weakness in a system, no matter how well sound it might be, is a CRITICAL mistake, one that plagues the industry today stares at the MITIRE company data breach. Know this wellâ€¦ THERE IS NO SUCH THING AS A 100% SECURE SYSTEM. For as long as it is man made it will always contain some form of flaw or error in them. People are able to make mistakes, therefore, said programs will also reflect said mistakes.</p> </br></br> <h4 id = "bypass" style = "text-align: center; color: #D43F52;">NEGATIVE PENALTY! MAC Address filtering can be bypassed! ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Mac address filtering involves configuring a network access point to only allow permitted devices to authenticate and access the internal network. In the event that an unauthorized user tries to access the internal network, the MAC address that is tied to their system will be checked and flagged by the security of the access point if it isnâ€™t registered as a permitted device. </p> <p></p> <p>For most this would appear as a great form of security overall. Only the administrator that configured the MAC address cache for the access point will be able to see which MAC addresses you need in order to be permitted to the network. Solid right? WRONG!</p> <p></p> <p>Here is the major flaw with this setupâ€¦.. There are 2 EASY ways to bypass this rule.</p> <p></p> <p>#1:</p> <p></p> <p>You can tap into the direct network feed if you find an open PHYSICAL network port. This also allows you to bypass any authentication methods that might be set in place even if you manage to spoof the MAC address through other means and get blocked by the WPA2 authentication process.</p> <p></p> <p>Even if you find the right MAC address, if they have a complex password to join the network, then youâ€™re out of luck if you try to do this the wireless method and you can't crack the password. It is possible to bypass using just the MAC address alone, but like all forms of wireless security, it's constantly improving and evolving over time, making some of these methods hard if not IMPOSSIBLE to easily pull off.</p> <p></p> <p>Physical network taps, which typically do NOT require authentication, allows you to bypass this simple filter. </p> <p></p> <p>#2:</p> <p></p> <p>The MAC addresses for any and all systems that are connected to the internal network are sent out in data packets, via â€œstationsâ€ that are connected to the main access point. </p> <p></p> <p>With a simple tool like Aircrack-ng, you can use monitoring mode to sniff out all the data channels and see which systems are connected to the network to spoof any and all internal MAC addresses, allowing you to bypass the security and authenticate to the network. </p> <p></p> <p>Of course there are other means to do this, but these are methods that I have tried and have succeeded with that have allowed me to breach access points that I have personally setup for these types of tests.</p> </br></br> <h4 id = "hiding" style = "text-align: center; color: #D43F52;">NEGATIVE PENALTY! Hiding your SSID can be bypassed ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>A common trick that a lot of people like to use in order to prevent unauthorized network breaches, is they like to hide their SSIDâ€™s which is the name of the network. This is effective in that you can hide SSID information from common means of exposure, like the GUI you use when selecting a wireless access point to communicate with.</p> <p></p> <p>The problem with this is it can easily be bypassed by the same method mentioned in option #2 of how to bypass MAC address filtering. </p> <p></p> <p>Your SSID is also broadcasted along with any and all MAC address information that is sent out in data packets. They have to be, otherwise our IoT devices would be unable to pick them up and identify them. THERE IS ALWAYS A WAY TO BYPASS ANYTHING! NOTHING IS 100 PERCENT SECURE!</p> <p></p> <p>Todayâ€™s positive bonuses will focus more on how to defend against MAC address filtering bypasses, preventing an attacker from breaching the network via this security method.</p> </br> <img src="Images/counter.png" class="img-responsive" alt="portfolio img"> </br></br> <p> If you would like to see the more advanced version of this article that talks about methods that can be used to mitigate, as well as any videos included, SUBSCRIBE TO MY PATREON CYBER SECURITY TIER! </p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "hhttps://futabawebs.github.io/Articles/DangerSSIDMACFILTERING" style = "text-decoration: none;"> <div class="d-grid">  </a>`;
         
}

function CookieHijacking()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_CookieSession" src = "Images/CookieSessionHijacking.jpg" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "premise" style = "text-align: center; color: #D43F52;">Premise ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>This is also a common means to breach a system you WILL see in a lot of CTF challenges, so PAY CLOSE ATTENTION IN THE VIDEO to how itâ€™s done. </p> <p></p> <p>As always, any and all advanced versions of this article with a video guide if given will be for PAID patreon members only!!</p> </br></br> <h4 id = "hijacking" style = "text-align: center; color: #D43F52;">What is Session Hijacking? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Before we dive into what Ransomware is, let's go over what FDE is, since it heavily applies to the topic for today.</p> <p></p> <p>FDE, full disk encryption, is a defensive technique that is used to harden data protection across all hierarchical flat file systems. It's the overall process of enumerating the entire file system, and then applying what is known as symmetric cryptography in order to encrypt the entire data storage medium. A good example of this would be bitlocker, which is commonly used for Windows system infrastructures.</p> <p></p> <p>As you know, data encryption is irreversible without the crypto keys, so by performing this method and leaving the keys out the hands of the attacker, should they breach the system, whether it be digitally or physically, any and all data they steal will be useless to them.</p> </br></br> <h4 id = "cookies" style = "text-align: center; color: #D43F52;">What are COOKIES? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Symmetric cryptography, also known as single key cryptography, is the process of using a singular crypto key known as a private key in order to both encrypt as well as decrypt data. It's commonly more used for FDE over Asymmetric due to it being the faster encryption method.</p> <p></p> <p>This makes sense as the overall process for FDE is to enumerate THE ENTIRE file system ENTIRELY and encrypt EVERY single file on the system. Asymmetric would be too slow for this as it's a slower encryption standard. It's also commonly used in mobile device data encryption as well for the same reasons.</p> <p></p> <p>Asymmetric encryption on the other hand uses two crypto keys to perform the same process, except, in this case, it uses a public key for encryption, and a private key for decryption. The main reason for this is to add more secure complexity for various data communication methods. Itâ€™s also commonly used in stuff like PGP, pretty good privacy, which is commonly used for secure email data encryption.</p> <p></p> <p>One of the BIGGEST downfalls of symmetric data encryption is it's VULNERABLE to interception attacks. Should an attacker intercept the crypto key, they can: decrypt all data and messages, replay new ones on behalf of the original recipients, and a lot more.</p> <p></p> <p>However, with Asymmetric encryption, this isn't the case. Since it uses two crypto keys which come in pairs, Should a threat actor intercept the communication pipeline and steal one of the keys, their efforts will be in vain, as they lack one of the means to facilitate a SOLID man in the middle attack.</p> <p></p> <p>The whole premise of a man in the middle attack is to not only intercept the communication, but to reply messages on behalf of the respective parties. By using public key cryptography on top of other data channel splitting techniques, you render this the ineffective and leave them in a situation where they canâ€™t facilitate it fully.</p> <p></p> <p>Should an attacker secure the public key only, then they'll only be able to send messages. They won't be able to read any of the data that is being sent back and forth, and any new messages will be suspected as false ones, which will lead to the replacing of the keys. Even if they verify with the key, it will all be for nothing.</p> <p></p> <p>However, in the event they have the private key, they'll be able to decrypt any and all messages, BUT, they won't be able to spoof and gain further insight and other information out of the communication pipeline. This is still a problem for them due to the fact most PKI infrastructures, even stuff like PGP, REQUIRE you to have the public key BEFORE you begin a communication to ensure message authenticity from the recipients. Simply not having the public key is like a lack of ID to verify who you areâ€¦. WHICH MEANS A DEAD PRIVATE KEY! This does vary depending on the infrastructure so do be mindful as I'm going over this.</p> </br></br> <h4 id = "cookiehijacking" style = "text-align: center; color: #D43F52;">What is Cookie Session Hijacking? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Now that we've gone over the basics, let's talk about what Ransomware is.</p> <p></p> <p>Ransomware is basically FDE with malicious intent. It's a form of malware that is known as "crypto" malware, which deploys cryptographic techniques that enumerate the victims file system, exfiltrating data from it, and then encrypting the main copy of the data on the file system, rendering it useless to them. Be mindful that "crypto" malware and "ransomware" are TWO different forms of malware. Crypto malware is the main archetype, where as Ransomware is the child of said archetype, inheriting cryptographic techniques. </p> <p></p> <p>After the data is encrypted, a message is displayed to the end user requiring them to pay a "ransom" in order to receive the crypto keys to decrypt their data, hence the name "ransomware". The problem with this is paying the ransom doesn't guarantee you will receive the keys.</p> <p></p> <p>Ransomware is on the rise for being an effective attack method because it can be combined with phage malware techniques and phishing techniques to become SUPER effective.</p> <p></p> <p>Before, a simple click of the link or mishap in security meant you had an undetected botnet. NOW, it means all your data is encrypted and unreadable, which can be problematic if you're handling sensitive data that has to do with critical record information like someone's student or home loan payment information for example.</p> <p></p> <p>Mr.Robot for example, one of their biggest exploits in the show was encrypting all of E Corp's data in order to "FREE" everyone from debt. HOWEVER, it caused quite the opposite effect, where now people that were close to being debt free, or had funds in their bank accounts, were unable to access anything or prove what they've made payments due to the data being indecipherable. The result? TOTAL CHAOS where the people they were trying to â€œFreeâ€ suffered more.</p> </br> <img src="Images/counter.png" class="img-responsive" alt="portfolio img"> </br></br> <p> If you would like to see the more advanced version of this article that talks about methods that can be used to mitigate, as well as any videos included, SUBSCRIBE TO MY PATREON CYBER SECURITY TIER! </p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://futabawebs.github.io/Articles/CookieSessionHijacking" style = "text-decoration: none;"> <div class="d-grid">  </a>`;
        
}

