function HTTPRequests()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_HTTPRequests" src = "Images/HTTPRequestsMethods.jpg" style = "border-color: violet; background-color: indigo;""> </h3> </br></br> <h4 id = "premise" style = "text-align: center; color: #D43F52;">Premise ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Weâ€™ve talked about how the internet works, and things like port forwarding, the TCP/IP handshake, etc, but weâ€™ve yet to discuss the actual HTTP methods you constantly see in stuff like burp suite for example. </p> <p></p> <p>As a hacker, itâ€™s crucial you know how they work, as you can tamper and interact with them in order to control how the server side responds to the client side of the connection. </p> <p></p> <p>For this article, there will be a video, demonstrating how to write HTTP methods via BurpSuite. As always, this will be for paid patreon members only. </p> <p></p> <p>For this article, we are ONLY going to talk about some of the basic ones you should know first: GET, POST, PUT, DELETE</p> <p></p> <p>Any other ones mentioned later on will be for paid patreon members only.</p> </br></br> <h4 id = "http" style = "text-align: center; color: #D43F52;">What are HTTP methods? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>HTTP methods are a series of request types that tell the backend of the server to perform a said action, and then interact with the client in a certain way. How each one works varies depending on the one that you are using.</p> <p></p> <p>The default HTTP methods that we are going to cover today are.</p> <p></p> <p>ğŸƒGET</p> <p>ğŸƒHEAD</p> <p>ğŸƒPOST</p> <p>ğŸƒPUT</p> <p>ğŸƒDELETE</p> <p>ğŸƒCONNECT</p> <p>ğŸƒOPTIONS</p> <p>ğŸƒTRACE</p> <p>ğŸƒPATCH</p> </br></br> <h4 id = "get" style = "text-align: center; color: #D43F52;">What is the GET HTTP request? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The GET HTTP method, the default one that is commonly used in any and all HTTP servers, is used in order to fetch data from resources on the HTTP file system. </p> <p></p> <p>For example, when you enter â€œhttps:// google [.] comâ€, your web browser will send over a GET request to the HTTP server in order to load the page you want to view.</p> <p></p> <p>It can also be used to fetch stuff like executables or files that are on the HTTP server that you wish to also download. </p> <p></p> <p>Itâ€™s also common for input parameter fields, like searching a website for products on the page you wish to purchase. When you enter in the name of an item you want to purchase, a GET request is made to the backend of the server, in which it will perform a database query that will retrieve the elements form the database, placing it in the given fields where the main web application wishes to present them to you.</p> <p></p> <p>For example, when you search â€œcatsâ€, in lets say a website for example, the main HTTP GET request, as well as the name of the item you are searching for is processed by the backend that will allow GET requests, parsing it, and piping in a request like so</p> <p></p> <p>â€œSELECT makeup FROM makeuptable WHERE Product_ID=â€YOUR_INPUTâ€. </p> </br></br> <h4 id = "post" style = "text-align: center; color: #D43F52;">What is the POST HTTP request? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The POST HTTP method is commonly used in scenarios where the HTTP server needs to handle user input data and submit it, like login data for example, or any kind of data that needs to be processed by the backend in order to perform a specific action. The backend handles said data, and then processes it to the system for a variety of purposes: resources directly on the file system, database queries, etc. </p> <p></p> <p>It can also be used to upload stuff like files for remote file inclusion for example. </p> <p></p> <p>It can also be used for simple retrieval purposes if needed to, but the main purpose of the request is to do what I just mentioned.</p> <p></p> <p>Threat actors commonly exploit the POST HTTP method in order to perform a variety of server side attacks, since, depending on how the backend of the HTTP server is configured to handle the processed data, they can manipulate the system in a variety of unique ways: SQL injection, Command injection, Cross Site Scripting, etc. </p> </br></br> <h4 id = "put" style = "text-align: center; color: #D43F52;">What is the PUT HTTP request? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The PUT HTTP method is used in order to modify and update resources that are already on the HTTP server file system. </p> <p></p> <p>It can also be used, depending on how the PUT request method is programmed for the backend, be used to add an entirely new resource to the system itself. </p> <p></p> <p>I say this strongly because, one of the obvious things to do as a security professional would be to ONLY allow it to update resources which is what itâ€™s designed to do.</p> <p></p> <p>If a threat actor finds a way to pull this HTTP method off, they can basically remotely include as many files as they want to the server and exploit the system in a variety of ways. </p> </br></br> <h4 id = "delete" style = "text-align: center; color: #D43F52;">What is the POST HTTP request? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The DELETE HTTP method is the opposite of the PUT HTTP request method, where instead of adding or updating files/resources on the main file system, it instead REMOVES them from the file system. </p> <p></p> <p>For this one, since itâ€™s obvious, you can wrap your head around whatâ€™ll happen if an attacker is able to pull this off.</p> <p></p> <p>This can be CRUCIAL for stuff like modifications to an end user account, when you change stuff like your username for example, as well as various aspects of information that need SPECIFIC ways of being updated on the HTTP server file system, that might or might not have to do with the end user specifically. </p> <p></p> <p>It sounds a bit complicated, but try to process the example Iâ€™ve just mentioned</p> </br> <img src="Images/counter.png" class="img-responsive" alt="portfolio img"> </br></br> <p> If you would like to see the more advanced version of this article that talks about methods that can be used to mitigate, as well as any videos included, SUBSCRIBE TO MY PATREON CYBER SECURITY TIER! </p> </br> </br> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </p> <a href = "https://futabawebs.github.io/Articles/HTTPRequestsMethods" style = "text-decoration: none;"> <div class="d-grid">  </a>`;
        
}

