function Tcm()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/futaba 6.jpg" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <h4 style = "text-align: center; color: #D43F52;">Synopsis ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Today's article is going to focus on a recent situation regarding TCM Security that went viral, where they revoked a TCM student's certifications, apparently, due to "meming" and trolling in their Discord server.</p> <p></p> <p>The problem with this, and why it went so viral, is because they claimed that the student cheated during their exam, which is why they revoked their certifications, BUT, refuse to show evidence to support their claims. This is extremely bad considering the situation and current accusations stacked against them.</p> <p></p> <p>As of the time of writing this article, and I'm sorry to say this.... Heath Adams has OFFICALLY blocked me on LinkedIn. SO... if ANY, and I mean ANY of the posts I tag in this article, should they be redacted or change on his end, you know why! My credibility is HIGH and I speak ONLY the truth!</p> <p></p> <p></p> <p>HOWEVER, if by some sheer luck he does finally speak out regarding the situation with CONCRETE evidence, I'll happily retract everything in this article. I doubt it, BUT, let's move on!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Whatâ€™s been going on regarding the TCM cert revoke situation ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>ğŸƒ TCM is basically being accused of revoking someoneâ€™s certs they PAID for because they were being trolled by them in their Discord server via memes, jokes that were essentially harmless.</p> <p></p> <p>Link to the Tweet that went viral can be found here, which has over 337K views and 69 retweets.</p> <p></p> <p>Although the Tweet censors the name of the Discord member, itâ€™s basically the student in question that Heath Adams claims cheated during their exam which he shows ZERO proof of.</p> <p></p> <p>Heath claims the student violated TCMâ€™s policies and sought external help during their exam, but when asked to disclose this information, even a censored version of it, he chalks it up to "privacy policies" and refuses to disclose ANYTHING, and he does, it's misleading which Iâ€™ll talk about in a bit.</p> <p></p> </br></br> <h4 style = "text-align: center; color: #D43F52;">TCMâ€™s Stance on the matter ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>This is an official response! from Heath Adams, founder and CEO of TCM Security.</p> <p></p> <p>In his initial response post, and I want you to be mindful of this later on in the article, HIS words exactly, was that he didn't know anything about the meme situation everyoneâ€™s been talking about. Apparently he didn't know the meme existed.</p> <p></p> <p>As you can tell, it sounds fishy because along with everything else thatâ€™s been going on, theyâ€™ve been refusing to disclose ANYTHING or provide SOLID proof of whatâ€™s been happening.</p> <p></p> <p>You can find out more about what I mean in this post here! from one of his official staff members that also does the same thing, where he defends TCM, but doesnâ€™t disclose anything to clear up all the confusion thatâ€™s been going on with them on their end. Repost with my overall thoughts for it can be found here!.</p> <p></p> <p>Shortly after, Heath Updates us on the situation in another post, but AGAIN, STILL didnâ€™t answer any questions DIRECTLY with EVIDENCE regarding the matter. I want you to pay CLOSE attention to this, as it becomes a concerning trend.</p> <p></p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Suspicions About Heath and TCM ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The BIGGEST suspicion about TCM right now is how theyâ€™re handling the situation, SPECIFICALLY, their unwillingness to disclose ANY information regarding the matter, more so since theyâ€™re claiming a student cheated but refuses to disclose screenshots of any kind due to â€œprivacy policiesâ€.</p> <p></p> <p>The kicker, and something strange? They happily disclose a few Discord messages from a student named â€œNajam UI Saqibâ€ who DID in fact cheat during his examination, which led to his certs getting revoked. HOWEVER, this was only due to his post that went viral which Heath HAD to respond to, otherwise it would just raise more suspicions that heâ€™s hiding something.</p> <p></p> <p>NOW, he DOES in fact respond with OFFICIAL Discord server screenshots of what happened and Najam cheating and him blocking TCM staff and avoiding the situation. It gets SOOO bad that Najam actually DELETES his entire post regarding the matter after it went viral.</p> <p></p> <p>I was ECSTATIC, BUT, as you can tell it felt a little â€œstrangeâ€. Why? Because TCM was UNWILLING many times to disclose ANYTHING, and now all of a sudden theyâ€™re dropping screenshots and spilling the beans? Something just felt off about it, and guess whatâ€¦ I WAS RIGHT!</p> <p></p> <p>You can find out more about that here!</p> <p></p> <p>HOWEVER, Heath raised a HUGE red flag when he messaged me directly explaining it â€œwasnâ€™tâ€ the student he was talking about regarding his second follow up post. Itâ€™s strange because now apparently there were TWO students even though he never mentions that once in any of his posts. He led us under the impression that ONE student that cheated.</p> <p></p> <p>This did lead to me having to revise my post MULTIPLE times, even a few folks commenting they were still confused regarding the situationâ€¦. And to be honestâ€¦ I was confused as well.</p> <p></p> <p>Something funny too, whenever ANYONE questioned what happened, Heath would BAN or BLOCK them RIGHT AWAY! He even kept an eye on people he felt would talk and looked them up on LinkedIn and blocked them right away, myself included, even if we didn't mention the companies name or his name.</p> <p></p> <p>You can find out what I mean in these two instances here!</p> <p></p> <p>ğŸƒ Instance1!</p> <p>ğŸƒ Instance2!</p> <p></p> <p>Thereâ€™s more of course, BUT, you get the point.</p> <p></p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Heath Lied About Not Knowing the meme in question ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>In Heathâ€™s first initial post regarding the matter, and I want you to think clearly about what I said before regarding his EXACT words, he mentions VERY CLEARLY he knows NOTHING about the meme everyone was talking about.</p> <p></p> <p>Sadlyâ€¦. That too was also a lie. I have screenshots of him admitting and acting childish about it which is in the process of being released upon further notice.</p> <p></p> <p>The sad part about this, is he also lies about banning Panda, which panda confirms with DIRECT evidence that it was in fact Heath that DID ban him from the Discord server.</p> <p></p> </br></br> <h4 style = "text-align: center; color: #D43F52;">TCM Revised Their Policies ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Shortly after the situation, TCM revised its policies which I found a little suspicious. Why? Because if it suddenly â€œchangesâ€ and no one is aware, it could lead to a situation where Heath could say stuff like this (meming) calls for a cert revoke. Iâ€™m not saying he would do that, BUT, it did scratch that part of my brain.</p> <p></p> <p>Nonetheless, I took a look at the core policies, which you can read hereâ€¦. Andâ€¦. wellâ€¦. Panda didnâ€™t violate anything nor is there a single screenshot of him cheating during the exam as Heath claims. The only person he had visible proof of doing so that he CONFIDENTLY exposes without question was the student I mentioned earlier, â€œNajam UI Saqibâ€.</p> <p></p> <p></p> <h4 style = "text-align: center; color: #D43F52;">The Truth? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The REAL victim of the whole TCM situationâ€¦ and Iâ€™m sorry to have to even say thisâ€¦ A LOT of the current evidence on deck DOES point towards their certs being revoked for speculated reasons, A LOT of which Heath admits to in his own Discord messages under his handle name.</p> <p></p> <p>You can find out more about the what's been going on via screen pics here!</p> <p></p> <p>There might be a further witness for the whole situation, BUT, I need her consent first before I feature her in the article. TRUST me on this, IF she does, and she releases further screenshots, it will be added to the massive archive of PHOTOGRAPHIC evidence I have for this article. You'll of course be kept up to date on this!</p> <p></p> <p>The student Iâ€™m talking about is named â€œExecPandaâ€. If you go back to that twitter screenshot, youâ€™ll see snippets of his profile pic exposed which IS an EXACT match!</p> <p></p> <p>He was kind enough to reach out to me via Discord and explain the situation to me in FULL detail with PROOF! He was honest about the whole thing, even the memeing and trolling on the server which DID call for the Discord ban. HOWEVER, this didn't justify his certifications being taken away from him, nor did it explain WHY they were taken away from him.</p> <p></p> <p>For those that might be wondering, since this has been aired out in the open, regarding the "joke/fake" cert situation with Panda, which he did admit to, this happens after his certs were revoked and removed without warning, where he was placed under investigation, also without warning. He assumes they're gone and have been revoked since he reached out to folks in the Discord server, most saying they still had theirs. This is WHY he does this. He also reaches out to staff formally and pops the question on whether or not they were revoked about an hour later after he does this, from which they CONFIRM his certs were revoked!</p> <p></p> <p></p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Is TCM Still Reliable? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>To be very honest.. Noâ€¦ not after this.</p> <p></p> <p>This article was kind of hard to write, since I looked up to Heath Adams when I was in my earlier days as a hacker.</p> <p></p> <p>I spoke good faith about him MANY times, even featured him in some of my past articles for people that wanted to break into Cyber, but he dropped the ball on this one.</p> <p></p> <p>He had the potential to become one of the greats when it came to Cyber Security training and industry certs. Now I have to take back what I said and revise a lot of that stuff.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">After Thoughts ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>This is going to be a bone chilling point I'm going to make.</p> <p></p> <p>Heath and everyone at TCM lectures us and says we should do our "research" yet prevents us from doing so.</p> <p></p> <p>The funny thing about what they're doing is when you prevent folks from researching it only leads to more speculation which can get out of hand.</p> <p></p> <p>It's even more sketchy since he openly discloses Najam but hides everything when it comes to Panda. You can expose one students handle name and all that but Panda is the exception?</p> <p></p> <p>The funny thing about what they're doing is when you prevent folks from researching it only leads to more speculation which can get out of hand.</p> <p></p> <p>The shady thing about this is they're supposed to inform him WHY his certs were revoked DIRECTLY with EXACT details! They just say he violated policies but NEVER specifically state what he did.</p> <p></p> <p>With Najam, they tell him. With Panda, they don't.</p> <p></p> <p>Just want you guys to let that marinate.</p> <p></p> <p>Thanks for reading folks!</p> <p></p> <p>If you enjoyed this post give it a thumbs up! Iâ€™ll be keeping track of whose reacting from now on as there is a â€œspecialâ€ reason for it. Just know the more you support my content the more there is in stored!</p> <p></p> <p> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸</p> </br></br>  </div>`;
        
}

function PersonalBrand()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;">  <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/futaba 5.jpg" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <h4 style = "text-align: center; color: #D43F52;">Synopsis ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Today's article will be centralized on HOW to build your personal brand! This is crucial for today's job market since it's more along the lines of "It's not WHAT you know, but WHO you know".</p> <p></p> <p>Building a personal brand allows you to network and find the RIGHT people that will take a chance on you! It's what got me where I am today and is what is allowing me to expand my opportunities!</p> <p></p> <p>You'll learn a lot of key stuff that could help you on your Cyber Security journey!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What's your end goal? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>When building a personal brand or any business (should you stray that path), the first thing you need to ask yourself is, "What do I plan to do with my brand?"</p> <p></p> <p></p> <p>You see, A LOT of people are all brain no aim. They'll have all these ideas, have all the smarts in the world, but will lack the ability to FOCUS on a particular area their brand should be specializing in. It's ok to specialize in more than one thing, which I happen to be doing, BUT, there needs to be some form of correlation otherwise you'll run into a situation where folks will question your brand identify, such as "What... do you guys do?".</p> <p></p> <p></p> <p>A good example of all of which I'm talking about can be found in one of my past articles here, where I talk about the goal for MY brand and all the types of stuff I do for it!</p> <p></p> <p></p> <p>Having an objective for your brand will also make it easier to build out the overall schematics for it!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Be Authentic! ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Ever seen a product so "unique" that you just knew you had to be apart of it!? This is where being authentic comes into play!</p> <p></p> <p></p> <p>Personal brands are just that, PERSONAL! It's a reflection of your overall uniqueness and personal traits.</p> <p></p> <p></p> <p>WHY is this important? Here's a little analogy that I think you'll understand. Ever picked up a piece of "music" and you "felt" like it "spoke out to you"? Being authentic allows you to connect with others who share the same perspective as you!</p> <p></p> <p></p> <p>For example, part of my brand is a whole "gamified" Cyber Security vibe! This allows me to connect with folks in the Cyber realm, A LOT of which recognize a lot of the iconic themes and references I drop all the time. This allows me to build a relationship and network with them, establishing what is known as "reputational" value that plays a big factor into whether they wish to support my content!</p> <p></p> <p></p> <p>Even the way I write my articles is authentic, in that I'm very "insightful", dinging the light bulb in folks head that gets them thinking!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Build a community! ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Relationship building is the next step when it comes to networking!</p> <p></p> <p></p> <p>When you're building a personal brand, don't forget the emphasis on PERSONAL! If you want people to support you, you have to be able to CONNECT with them on a PERSONAL level! Failing to do so will have them question whether or not they should support your brand!</p> <p></p> <p></p> <p>Me personally, I only engage and support those that interact with their community and GENUINELY mean it!</p> <p></p> <p></p> <p>If you've been paying close attention to all the Discord stuff I've been doing lately, my goal is to further connect with folks by chatting and engaging with them on a regular basis, as well as learning some more neat stuff about me, further relating to them!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">How To Get Seen? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>I can't say this works for all platforms, but IT SURE AS HECK works for LinkedIn!</p> <p></p> <p></p> <p>ğŸƒ Commenting and Engaging</p> <p></p> <p></p> <p>Commenting and Engaging, SPECIFICALLY on others posts allows you to establish some overall presence!</p> <p></p> <p></p> <p>When I was trying to get my name known in the Cyber Security field, I would comment under any and all major Cyber Security posts, even going as to challenge and enlighten those that have been at it longer than I have! This lead to my name getting seen and folks wanting to connect with me to hear more of what I had to say!</p> <p></p> <p></p> <p>The kicker to this? Not only do the original posters SEE your name, but so do the people in their comment section, folks related to them should they interact with you, and so on.</p> <p></p> <p></p> <p>ğŸƒ Comment and Engage on your own stuff</p> <p></p> <p></p> <p>Ever wondered WHY I always comment and react to my own posts, as well as any comments I place in them?</p> <p></p> <p></p> <p>LinkedIn ensures that ANYONE and EVERYONE you're connected to can SEE what you comment and react to! This includes YOUR posts as well! You can capitalize on this on top of what I've previously mentioned in order to get some serious traction!</p> <p></p> <p></p> <p>ğŸƒ Post regularly</p> <p></p> <p></p> <p>This might not come as a shocker, but YES, post REGULARLY! The LinkedIn algorithm as well as any other form of social media favors those that are CONSTANTLY active! How can you get seen if you don't post often?</p> <p></p> <p></p> <p>ğŸƒ Stop caring if a post flops!</p> <p></p> <p></p> <p>One of the biggest issues as to why folks don't post on a consistent schedule is due to the fear of a post not doing well, OR, whether or not they believe people will care about it!</p> <p></p> <p></p> <p>Here's the thing, and even I still go through this, PEOPLE ARE GOING TO IGNORE THE SH*T out of you in the beginning! You might feel like you're not getting anywhere, but I PROMISE you, if you stop advertising yourself and putting in the work then NO ONE will know your name.</p> <p></p> <p></p> <p>Me keeping it consistent with my brand has lead to me getting featured into all sorts of stuff and overall being a TRUSTED voice in my community, whose words INFLUENCE people when spoken!</p> <p></p> <p></p> <p>All of which I've stated could also relate to selling a product should you be doing so!</p> <p></p> <p></p> </br></br> <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/asian1.avif" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <h4 style = "text-align: center; color: #D43F52;">Capitalize ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>By now you should have a general swing of things for how you plan to run your personal brand. Take from that and CAPTITALIZE on it in order to gain more exposure and improve overall aspects of your brand that are KEY objectives for it. Interconnect and build on what you have to further improve it's overall foundation essentially!</p> <p></p> <p></p> <p>Nonetheless, I took a look at the core policies, which you can read hereâ€¦. Andâ€¦. wellâ€¦. Panda didnâ€™t violate anything nor is there a single screenshot of him cheating during the exam as Heath claims. The only person he had visible proof of doing so that he CONFIDENTLY exposes without question was the student I mentioned earlier, â€œNajam UI Saqibâ€.</p> <p></p> <p></p> <p> If you enjoyed this post give it a thumbs up! Iâ€™ll be keeping track of whose reacting from now on as there is a â€œspecialâ€ reason for it. Just know the more you support my content the more there is in stored! </p> <p></p> <p></p> <p> - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸</p> </br></br> </div>`;
        
}

function WomensHistoryMonth2025()
