function ExMachinaParlor()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;">  <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/ExMachinaParlor.jpeg" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <h4 style = "text-align: center; color: #D43F52;">Synopsis ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p> Today I wanted to talk about an up and coming non for profit Cyber Security organization, Ex Machina Parlor (Previously known as the "ToolBox"), run by Lexie (Alex) Thach, a Woman in Cyber/Tech who specializes in Electrical Engineering/Robotics and various ways to integrate it with Cyber Security. She also does some cool stuff regarding drone security and a lot more. </p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What/Who is Ex Machina Parlor? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Now, what is Ex Machina Parlor and what is their goal?</p> <p></p> <p></p> <p>Ever seen the Hackerspace in "Watch Dogs 2" where Marcus, Wrench, and various members of the team work on all sorts of projects, sharing and collabing resources? What if I told you we could have something like that!</p> <p></p> <p></p> <p>What if I told you they could make all of that ACCESSIBLE and AFFORDABLE to you much like with HTB and TCMâ€™s stuff? Do you still follow?! GOOD! Keep reading, it only gets better, PROMISE!</p> <p></p> <p></p> <p>Part of Ex Machina's goal is to create a hackerspace where you can visit either PHYSICALLY or VIRTUALLY, and participate in their overall Cyber range, allowing you to grow as Hackers and Cyber Security professionals.</p> <p></p> <p>Essentially Ex Machina's goal is to turn the big TWO, HTB and TCM Security into the big THREE. There's no telling what's possible if they actually manage to pull this off? Not only will you be able to learn the basics from HTB and TCM, BUT, when youâ€™re ready to begin APPLYING the knowledge, youâ€™ll have Ex Machina to help you step up your game!</p> <p></p> <p></p> <p>Imagine stuff like SEIM, SOAR, MITRE setups, even azure active directory stuff you'd probably need to purchase a subscription and a lot more, along with a ton of other stuff all accessible to you now! Imagine wanting to learn how to code, or get HANDS on training with Robotics, stuff you'd HAVE to spend A LOT of money on in order to even do the thing, also available to you now?! This also goes for PHYSICAL hacking tools and a lot more! Imagine all that being accessible to you in one or more PHYSICAL spaces! This is essentially what Hacker culture SHOULD feel like and is what theyâ€™re going for!</p> <p></p> <p></p> <p>Oh, did I mention folks there are MEGA friendly and youâ€™ll get CLOSE up guidance from them? Thatâ€™s mentorship basically!</p> <p></p> <p></p> <p>Wanna help them succeed? Well, their non-profit, so in other words, contribute what you can in order to ensure you as well as everyone else that needs PRACTICAL, both HANDS on as well as VIRTUAL training. Give them a follow and join their discord server to see what their all about!</p> <p></p> <p></p> <p>Link to their discord server can be found here!</p> <p></p> <p>The main goal of FREE resources/training is so folks can bypass the paywall barrier, allowing them to have just as much as a chance compared to those holding a 4 year degree along with certs. But, if they aren't even given a chance to apply that knowledge then it's just as useless as a person with a degree/certs, whom might I add, most likely put themselves in debt just to achieve that.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Who Is Lexie (Alex) Tach?psis ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Specializing in Electrical Engineering/Robotics and various ways to integrate it with Cyber Security. She also does some cool stuff regarding drone security and a lot more.</p> <p></p> <p></p> <p>Tbh, you guys know how I'm the multi-tool of skill sets: Electrical Engineering/Robotics, IT, Networking, Software Engineering, etc etc, I think you know where I'm going with this haha. She's basically ME... BUT.... ON FU*KING steroids. If ONLY you could meet her in person haha. She's one of a kind and her caliber is out of this world! She's more versed than me and there's a lot both you and I can learn from her! </p> <p>If you enjoyed this post give it a thumbs up! Iâ€™ll be keeping track of whose reacting from now on as there is a â€œspecialâ€ reason for it. Just know the more you support my content the more there is in stored!</p> <p></p> <p></p> <p>- The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸</p> </br></br> </div>`;
        
}

function Confluence()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/confluence.png" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <h4 style = "text-align: center; color: #D43F52;">Synopsis ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p> Today's article is going to focus on the most recent ransomware data breach on the Confluence data center. </p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Who is Confluence? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Confluence is essentially a cloud based data center that specializes in centralized based cloud data backups, allowing various individuals to access it at a time.</p> <p></p> <p></p> <p>This is NOT an exact analogy, BUT, a better way to think of it would be if I held files on my google drive and I was able to give certain people access and share that data with them. THAT, is what I mean by â€œcentralizedâ€.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What is CVE-2023-22527? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>It's an RCE/RDP exploit that can be pulled off via OGNL injection which is a popular java based expression framework that can be found in the Confluence infrastructure.</p> <p></p> <p></p> <p>The exploit takes advantage of the centralized aspect of the system, a SMB collective, that can be accessed by various companies that up and funnel all their data so they can share it with one another.</p> <p></p> <p></p> <p>If a threat actor manages to leverage the system they'd be able to infect it with spoofed versions of the original that are obfuscated with malware, pivoting into a botnet and a lot more.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What is Metasploit? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Metasploit is an offensive security penetration testing framework that can be used for a variety of penetration testing methodologies: web application, networking, C&C/botneting, mobile hacking, etc. Itâ€™s a multi-tool power house in case you havenâ€™t noticed, and has left a legacy, where tools like SET, routersploit and even kali nethunter mimic in terms of overall terminal functional and design. It also has one of the best well maintained database archives of any and all exploits that exist in its database. The code written and stored in it is beyond our deserving.</p> <p></p> <p></p> <p>In some cases it can be used to install malware on a system depending on how well the exploit is performed and the level of privileges on the system.</p> <p></p> <p></p> <p>You can learn more about Metasploit in one of my past articles here! Full Patreon exclusive video in full details that can be purchased from me if you want to learn all the PRACTICAL basics really quickly!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What is MimiKatz? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p> MimiKatz is a beloved and commonly used tool for hackers to leverage various credentials on a system, specifically Windows ones, allowing them to do stuff like: privilege escalation, pass the hash, essentially uncovering any plain text files that would have credentials, allowing threat actors to gain admin rights. </p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What is PDQ? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>It's essentially a tool that is used in order to install various files and software packages on a system.</p> <p></p> <p></p> <p>Why's this bad? Well, for starters, if you manage to to leverage a system, you can install and upgrade any form of software you want on it remotely. In the hands of a threat actor you can infect a singular trusted system, even a redundant one, and install any and all needed tools, infecting a network even further as well as any SMB file shares it might contain like in this case.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What is AnyDesk? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Ever heard of "TeamViewer"? AnyDesk is just another form of a commercial GUI based RDP tool that can be used to access another system, making it seamless to install any and all forms of malware on a system.</p> <p></p> <p></p> <p>Remember that little bit on how I explained that Confluence data centers are centralized and HOW they can be compromised?</p> <p></p> <p>With AnyDesk, not only can you get a remote connection established to a system, BUT, you can also get a GUI based one, taking advantage of infrastructures that already use and or trust it in the process as well.</p> <p></p> <p></p> <p>With AnyDesk, not only can you get a remote connection established to a system, BUT, you can also get a GUI based one, taking advantage of infrastructures that already use and or trust it in the process as well.</p> <p></p> <p></p> <p>Using anydesk allows you to: Check for sensitive files using mimikatz more accurately, input admin credentials and give permissions for them, run PDQ, and a lot more. Think of it like LITERALLY being able to not only see someoneâ€™s screen BUT, youâ€™re able to control it as if you were there. The ultimate form of a pwned system.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What is LockBit? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>LockBit is a form of data at rest symmetric encryption algorithm that's used in order to encrypt and secure all files on a windows file system, rendering it infeasible to threat actors that either remotely access the drive OR, physically by simply stealing it.</p> <p></p> <p></p> <p>This article was kind of hard to write, since I looked up to Heath Adams when I was in my earlier days as a hacker.</p> <p></p> <p></p> <p>I spoke good faith about him MANY times, even featured him in some of my past articles for people that wanted to break into Cyber, but he dropped the ball on this one.</p> <p></p> <p></p> <p>He had the potential to become one of the greats when it came to Cyber Security training and industry certs. Now I have to take back what I said and revise a lot of that stuff.</p> <h4 style = "text-align: center; color: #D43F52;">How is LockBit Ransomware? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Ransomware is essentially what LockBit does, BUT, with malicious intent!</p> <p></p> <p></p> <p>Imagine if a threat actor leveraged your system and encrypted it without your consent, holding the key? THIS is what I mean. LockBit was basically used in a more malicious manner which becomes easily feasible ESPECIALLY more so since it's a "tool" already made that has access and can be used to accurately target files on the system, or the whole system itself.</p> </br></br> </br></br> <h4 style = "text-align: center; color: #D43F52;">What are SMB's? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>SMB's, a term commonly used for Windows file share systems, uses the FTP protocol to host an accessible file share server that can be accessed by various systems on either a local or remote network to access data.</p> <p></p> <p></p> <p>Think of it like this, imagine you had all your: pictures, folders, documents, etc, and all of that was open and free via a port on your system to be shared with others remotely. This is what a SMB essentially is! SMB is again specifically a term for Windows based file shares, but overall these are classified as â€œFTP Servicesâ€, which stands for â€œFile Transfer Protocolâ€ service.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What is Rclone? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Rclone is what allowed threat actors to escavate files from all systems associated with the Confluence file share, syncing it to remote systems on their end, leaving the encrypted ones behind and the clean ones only with them, as well as the key they have.</p> <p></p> <p></p> <p>You can find out more about rclone here!</p> <p></p> <p></p> <p>If you enjoyed this post give it a thumbs up! Iâ€™ll be keeping track of whose reacting from now on as there is a â€œspecialâ€ reason for it. Just know the more you support my content the more there is in stored!</p> <p></p> <p></p> <p>- The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸</p> </br></br>  </div>`;
        
}

function Confluence2()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/rclone.png" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <h4 style = "text-align: center; color: #D43F52;">Synopsis ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Picking up from where we left off, now that we have a proper understanding of HOW all the tools threat actors used to compromise Confluence data servers, letâ€™s dive into the official case study of how it all went down.</p> <p></p> <p>If youâ€™re behind on my coverage of the DFIR report, check out the first part here!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">The Attack Tree ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>In order to give you a more visual perspective of whatâ€™s going on, reference this model here, and as I discuss each section of the initial access to the system, reference it to the best of your ability here. If you have any further questions the best way to reach me is via my discord server.</p> <p></p> <p></p> <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/AttackTree.jpeg" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <h4 style = "text-align: center; color: #D43F52;">The CVE-2023-22527 Exploit ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p> After threat actors were able to successfully compromise Confluence data servers via OGNL injection and establish RCE to the data servers, they tried the most common initial commands to check if the had access to the server, stuff like: whoami(tells you the user name on the system), net(which shows file share servers mapped to the system on the network), etc. </p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Establishing a CLEAN shell ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Iâ€™ve mentioned this before in one of my past research articles, but one of the most common things threat actors like to do once they gain access to the system is setup a clean shell.</p> <p></p> <p></p> <p>As security professionals, one of our main concerns is to deter this. You see, you wonâ€™t ALWAYS prevent threat actors from gaining access, BUT, when or should they do, you want to render their access as infeasible as possible. Essentially, make their access useless.</p> <p></p> <p></p> <p>Threat actors initially tried the classic old curl command to â€œwgetâ€ anydesk and run it on the system which initially failed, so they decided to use a windows binary program called â€œmshtaâ€ which is another means to retrieve the correct stagger they needed via metasploit in order to establish a CLEAN shell to the data server.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Access GRANTED ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Within the first 10 mins of compromising Confluence data servers, threat actors did and initial check of any and all processes running on the system.</p> <p></p> <p></p> <p>Why? For starters: to check if there are any important processes on the system that could allow them to deal more damage to the system, to check if there are any security processes running on the system, and lastly, to check if anyone else has access to said system and boot them.</p> <p></p> <p></p> <p>Itâ€™s been assessed that prior access from other threat actors might have existed on the server, so threat actors decided to pull the plug on them to maintain clean access for themselves without any further disturbance.</p> <p></p> <p></p> <p>Once everything was checked, they killed their own shell (in the process of said checks), connecting back to the system in order to create administrative accounts on the system, elevating their privileges.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Take Over 5 ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>A clever thing the threat actors did next, very fascinating, was they used the local account in order to RDP into admin areas of access, even going as far as to take advantage of the trusted system on the network theyâ€™ve compromised, leveraging SoftPerfects network scanner, using it against them.</p> <p></p> <p></p> <p>In simpler terms, they used their own security scanners against them to find all targets on the network, a trusted tool whose probes wonâ€™t be blocked on the network. This is what we would call Living off the land, where threat actors bypass detection systems by using ONLY what is trusted by the network itself.</p> <p></p> <p></p> <p>How do you defend against this? Well, itâ€™s quite simple. Not every system should be trusted to do certain things. If you detect a system that has no need to run said scans, block the probes!</p> <p></p> <p></p> <p>How did they get the credentials to do this in case they might have needed it? Remember Mimikatz? Yeah, they used it in order to scope out and enumerate all needed credentials, allowing them to do anything they want with administrative privileges!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Rcloneâ€™s Turn ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Next, threat actors leveraged data backups by enumerating Veeam credentials via a powershell script, which allowed them to excavate all files from the server via Rclone, a tool designed to clone and transfer all files from a file system remotely.</p> <p></p> <p></p> <p>Essentially they created their own File sharing server, and then cloned the files there using Rclone.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">The LockBit Exploit ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Once threat actors fully cloned all the files from the server, the next thing they did was deploy the ransomware. They did this using LockBit against them, a FDE encryption at rest algorithm that encrypts all files on the system upon shutdown, preventing threat actors from utilizing said data.</p> <p></p> <p></p> <p>They did this in a clever way by leveraging PDQ, a deployment software system, in order to fully deploy the ransomware script via SMB file shares. That way whenever anyone accessed the SMB file share servers, they wouldnâ€™t suspect a thing, executing the ransomware exploit!</p> <p></p> <p></p> <p>In total time the exploit took about 2 hours to complete!</p> <p></p> <p></p> <p>Thanks for reading folks!</p> <p></p> <p></p> <p>If you enjoyed this post give it a thumbs up! Iâ€™ll be keeping track of whose reacting from now on as there is a â€œspecialâ€ reason for it. Just know the more you support my content the more there is in stored!</p> <p></p> <p></p> <p>- The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸</p> </br></br>  </div>`;
        
}

