function BondBetweenTeacherAndStudent()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/BondBetweenTeacherAndStudent.avif" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <h4 style = "text-align: center; color: #D43F52;">Synopsis ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Todayâ€™s article is going to focus on what it means to be a GOOD mentor, which is CRUCIAL when training the next up and coming generation of Cyber Security professionals. This article is gonna be a short one and might also be of use to some folks in my network that might want to get into mentoring themselves, as itâ€™s a solid way to hone your knowledge and skills, passing it onto the next person. Iâ€™ve been mentoring for roughly 5 years now, so I think itâ€™s safe to say I have some solid experience under my belt.</p> <p></p> <p>but Iâ€˜ve never really clarified on HOW to be a GOOD one. Ever heard the phrase â€œThere is no bad student, only bad teacherâ€? WELLâ€¦ this is 99 percent true to a HIGH degree, more so coming from someone thatâ€™s autistic/neurodivergent.</p> <p></p> <p>Most people, even if theyâ€™re highly capable Cyber Security professionals or at whatever it is they do for a living, ARENâ€™T fit to be teachers/mentors. Youâ€™ll understand what I mean by that as you continue reading the article.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Understanding the Student ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>One of the biggest issues as to WHY most people arenâ€™t good mentors/teachers is because they LACK the ability to understand their students. This is crucial when teaching someone as each individual learns in a UNIQUE manner, ESPECIALLY if they happen to be autistic/neurodivergent like me.</p> <p></p> <p>For example, due to my Visualspatial IQ, Iâ€™m a VISUAL learner, on top of being a low level and logical thinker. In order for me to properly understand what it is youâ€™re teaching me, you NEED to provide a more visual example to me as well as explain it in FULL detail, which leads to my next point.</p> <p></p> <p>Fun fact before I move on, but did you know I FAILED out of all my programming courses when I was new to them simply because of this major issue? It wasnâ€™t just me but 90 percent of the students in all my classes as well. It made me lose confidence in my ability to learn programming as well as pursue tech. When I started teaching myself how to code thanks to â€œThe New Bostonâ€ who TAUGHT me how to code, I realized the issue wasnâ€™t me, but the teachers I had, where his videos explained EVERYTHING in full detail. Stuff like while loops which went over my head, became easier and made sense, which allowed me to progress and realize, NO, Iâ€™M EXTREMELY GIFTED at programming. Even now I could code circles around most of my old professors whose classes I failed out of haha.</p> <p></p> <p>Fun fact, my teaching style stems from â€œThe New Bostonâ€.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">EXPLAIN IN FULL DETAIL! ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Now this might be MEGA OBVIOUS, but YES, PLEASE, FOR ALL THAT IS PURE, EXPLAIN EVERYTHING IN FULL DETAIL. Iâ€™M LOOKING AT YOU MATH TEACHERS!!!!! Youâ€™d be surprised how A LOT of complex subject matters arenâ€™t as hard as we make them out to be.</p> <p></p> <p>One of the saddest realities of being really â€œsmartâ€ or really â€œgoodâ€ at something is we â€œforgetâ€ that not everyone knows what we know. This can be problematic if you forget to explain all the little details of what it is youâ€™re teaching. The only time you should EVER assume a student should know something is unless youâ€™ve listed it as PRE-REQUIRED KNOWLEDGE BEFOREHAND, otherwise, you explain it in FULL detail.</p> <p></p> <p>For example, my articles. Iâ€™m not sure if youâ€™ve noticed, but I explain EVERYTHING in FULL detail even if the reader might already KNOW what Iâ€™m talking about. This can be annoying to some, HOWEVER, Iâ€™m FULLY aware that not everyone knows what I know, so as such, I break it down in a manner where everyone can follow along, even highlighting some stuff that more advanced readers might have known.</p> <p></p> <p></p> <p>- The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸</p> </br></br> </div>`;
        
}


function OOPForDummies()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/OOPForDummies.png" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <h4 style = "text-align: center; color: #D43F52;">Synopsis ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Todayâ€™s article is going to be quite interesting. Remember how I said Iâ€™d eventually cover OOP (Object Oriented Programming)?.... Wellâ€¦ THE TIME HAS FINALLY COME! Object oriented programming, as much as many folks (except for me shockingly haha) hate, ITâ€™S A REQUIRED skill and knowledge set ESPECIALLY if you plan to be a Software engineer or read ANY form of code in general. I kid you not, NOT knowing OOP will lock you out of being able to read 99 percent of modern code today. Itâ€™s EVERYWHERE so itâ€™s CRUCIAL you understand it.</p> <p></p> <p>For todayâ€™s article, instead of teaching it via conventional analogies and methods, Iâ€™m going to mix it up a bit and do it my own way. Iâ€™m also going to simplify and elaborate on stuff like Polymorphism as well. Iâ€™m going to stick to the more general stuff thatâ€™s seen in many languages that feature some form of OOP. Iâ€™ll even talk about stuff like methods which is Javascripts supposed â€œanswerâ€ or â€œversionâ€ of OOP in a sense (although they still feature it in C++ fashion shockingly).</p> <p></p> <p>Sit back, relax, and prepare to embrace how something is so complicatedâ€¦ CAN BE REALLY SO SIMPLE HAHA.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What is OOP? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>OOP, which stands for Object Oriented Programming, is just basically a way to model custom functions that you can call and use around in your code. It simplifies the complexity and time consuming need to re-write complex programming algorithms from scratch, making your life easier. A perfect example of what I mean by that would be modules like with Python, were you can just â€œimportâ€™ or â€œincludeâ€ something and you just call an â€œobjectâ€ for it and youâ€™re good to go.</p> <p></p> <p>For example, (DOWNLOAD THE IMAGE IF IT'S TOO SMALL FOR YOU)</p> </br></br> <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/pythoncode.png" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <p> Without OOP, youâ€™d have to build ALL, and I mean ALL of this from scratch over and over and over again.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What is OOP (Members)? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Youâ€™ve probably seen me mention something about â€œmembersâ€ that belong to a class, where you can â€œcall themâ€ and use any that are available to you. Members are basically the overall functions that make up classes and can even be made available to other classes that need them via â€œPolymorphismâ€, which is a fancy term for â€œinheritanceâ€, which is where other classes youâ€™ve written â€œinheritâ€ functions belonging to other classes you have Think of it like â€œbiologyâ€, where you â€œinheritâ€™ dominant and recessive traits stemming from your parents.</p> <p></p> <p>Hereâ€™s an example to put it better into perspective for you. Iâ€™m going with C++ on this one since itâ€™s THE BEST example one can give on the matter</p> </br></br> <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/cppcode1.png" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/cppcode2.png" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/cppcode3.png" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <p>I hope this little light hearted lesson on what OOP is helped you out a ton.</p> <p></p> <p></p> <p>- The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸</p> </br></br> </div>`;
        
}

function DoCertsStillMatter()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;">  <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/DoCertsStillMatter.jpg" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <h4 style = "text-align: center; color: #D43F52;">Synopsis ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Todayâ€™s article is going to tackle an important matter, one that is often debated about much which is slowly changing in terms of priority over time from a realistic standpoint for the overall Cyber Security job marketâ€¦. Certifications Vs Experience, specifically, which of the two matter more, and which one will land you a job in Cyber. We go back and forth on the matter, but we never really sit down and â€œthinkâ€ about the benefits and drawbacks of both, and whether not one or the other is betterâ€¦ OR both!</p> <p></p> <p>Over the course of this article Iâ€™m going to highlight the benefits and drawbacks of both, comparing the two in order to ultimately decide which one is better. Be mindful, this is just my overall opinion and you are free to disagree with me if you like. Also be mindful, a lot of what Iâ€™m going to talk about will also carry over to other areas of tech besides Cyber, so do pay close attention to all of what Iâ€™m about to say.</p> <p></p> <p>Also, like always, pay CLOSE attention to the way I â€œwordâ€ the overall article. Youâ€™ll get tripped up a lot if you donâ€™t pay attention to the way I compare the two. In other words, PUT YOUR THINKING CAP ON!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What Are Certifications? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Certifications are the highlights of your knowledge on a particular domain within Cyber Security and contain the fundamental knowledge for you to pursue that particular area. They PROVE whether you have the sufficient knowledge to begin applying it.</p> <p></p> <p>For example, the CySA+ cert is the fundamental one for if you are pursuing a field in Cyber Security as a Cyber Security Analyst. It contains all the basic and advanced terminology youâ€™ll see in the domain that you need to be familiar with, as well as knowledge on all the tools and frameworks you need to know before you get hands-on experience with it. Passing the exam indicates you are READY to apply to it!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">The Benefits of Certs? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Certifications serve you well in the long run, much like degrees (I know theyâ€™re hot garbage now haha), allowing you to meet the essential prerequisites for employers to even look at your resume when submitting a job application. Without them, youâ€™ll be 10000 percent rejected on the fly as most AI/ATS systems filter you out simply for not having it.</p> <p></p> <p>You also become a PRIORITY over those that ONLY have experience, a common thing Iâ€™ve experienced myself when applying for jobs in Cyber, jobs Iâ€™m PLENTY qualified to do, which is the main reason Iâ€™m now going for them as well as my degree through WGUâ€™s bachelors degree program.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">The Drawbacks Of Certs? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> They donâ€™t necessarily mean you have the equivalent hands on experience nor do you understand the material on a fundamental level that is often required. Theyâ€™re typically just multiple choice questions you answer looks at Comptia. They also cost A LOT OF MONEY and lock people that arenâ€™t financially able to go for them like myself and many others. This is a HUGE problem, which is the main reason why theyâ€™re slowly chiseling out as a major priority for job requirements. </br></br> <h4 style = "text-align: center; color: #D43F52;">Which Certs to Go For? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Go for certifications that are PERMANENT! Comptia ones are trash and require you to annually renew them each year, PER cert. Certs from HackTheBox - Dr. AITH as well as OffSec. Once you pass them youâ€™ll never have to retake or re-certify them. That, and they are HIGH In demand and will actually land you a job cert alone!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">The Benefits Of Experience ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The overall benefits of experience, is that wellâ€¦ itâ€™s EXPERIENCE, meaning youâ€™ve not only learned the material, such as myself and many other self-taught folks, but have APPLIED the material, which is a HUGE problem with most cert holders today.</p> <p></p> <p>Experience can come in a variety of types: on the job experience, personal experience like projects and home labs, etc etc. How you get it, and the QUALITY of it, depend on how you go about it.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">The Drawbacks of ONLY Having Experience? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> As Iâ€™ve stated before, even if you have experience, if you donâ€™t meet the degree/cert requirement, youâ€™ll often be less favorable to employers. In their eyes, CERTS matter more and define your overall skill levelâ€¦ OR DO THEY!? </br></br> <h4 style = "text-align: center; color: #D43F52;">Which is Better? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> Overall Experience is better and will CURB stomp ANYONE that is simply only holding a cert. Iâ€™ve talked about this before, but Iâ€™ve done a few CTF competitions with cert holders, and yeahâ€¦ ahemâ€¦. A LOT OF THEM WERE STRAIGHT TRASH! Couldnâ€™t run a few basic lines of Linux commands even if you had it set out in front of them. Itâ€™s a HUGE problem, and is the MAIN reason why the hiring process for Cyber is now favoring ACTUAL SKILLS vs having certs/degrees, the degree requirement soon to be a thing of the past. Overall, to maximize your effectiveness in the overall job market, try pursuing both, as itâ€™s what I and a lot of other experienced professionals are already doing, which is now possible and affordable due to WGUâ€™s Cyber Security degree program. If you enjoyed this post give it a thumbs up! Iâ€™ll be keeping track of whose reacting from now on as there is a â€œspecialâ€ reason for it. Just know the more you support my content the more there is in stored! - The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </br></br> </div>`;
        
}

