    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/TheEvilHERO.png" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <h4 style = "text-align: center; color: #D43F52;">Synopsis ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Todayâ€™s article is going to be a more Darker toned one where I elaborate on why I became a professional Hacker, diving more into the deep complexities and mysteries behind my overall skills sets as well as one of the true hidden purposes behind my brand and what it is I aim to achieve with it on top of the many things it does/plans to do already. This article is going to be a bit on the 5 to 6 min read side so do be warned!</p> <p></p> <p>Iâ€™m also going to further elaborate on WHY I identify as a â€œGray Hatâ€ Hacker, something Iâ€™ve mentioned before but never really dived into much which plays a HUGE role in explaining the overall premise of this article. Iâ€™ll brush up on what a Gray Hat Hacker is so that anyone reading this can follow along smoothly, as well as leaving a link to the various Hat Archetypes that define each hacker and their overall purpose.</p> <p></p> <p>Most people when theyâ€™re looking to get into Hacking/Cyber Security their overall purpose is to either do it for fun or to pursue it as a professional career. Usually itâ€™s a mixture of the two which is also part of the main reason I do it. HOWEVER, like Iâ€™ve stated in the main premise, thereâ€™s another hidden reason I do this, and why my skill sets are so broad for what they are.</p> <p></p> <p>I want you to pay CLOSE attention to the title of this article, as itâ€™s symbolic and serves a purpose.</p> <p></p> <p>Fair warning before I begin, this article will contain SENSITIVE topics that might be faint for the heart, so feel free to click off this if this ainâ€™t your cup of tea. I want to experiment with writing articles that address real world matters and how Hacking/Cyber Security applies to it, rather, what we can do as Hackers/Cyber Security professionals to address it.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What is a Gray Hat Hacker? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Gray Hat Hackers are a mixture of quality traits between White Hat Hackers, whom are good guys, and Black Hat Hackers, whom are bad guys, incorporating a series of ethical and unethical means in order to achieve their objective which tends to be more along the lines of â€œHacktivismâ€ for a greater cause or purpose. To put it into better perspective, they are GOOD guys that arenâ€™t afraid to get their hands dirty, hence being in the gray area swaying either way. Their skill sets also tend to be a bit broad while having a certain niche.</p> <p></p> <p>A PERFECT example of one would be the infamous â€œAnonymousâ€ group, where they target a lot of terrorist groups and corrupt organizations and expose them for the betterment of the world! They do whatever it takes to get the job done incorporating a wide variety of techniques, which allows them to achieve feats the ordinary Hacker/Cyber Security professional might have never thought were possible.</p> <p></p> <p>Be mindful, although Gray Hats arenâ€™t afraid to get their hands dirty and will do ANYTHING to get the job done, they donâ€™t usually resort to killing, as they tend to be more on the pacifist side, not ALL, but most in general.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Hunter Hunter ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Iâ€™ve talked about this before in my â€œThe One Above Allâ€ article, but one of the main reasons why hackers do what they do is because THEY LOVE the THRILL of the hunt. What it is they like to hunt depends on the hacker which will greatly influence the skill sets they possess.</p> <p></p> <p>For example, CTF players that hack on a comptetional level, love the overall thrill of finding the exploit to secure the flag which tests the full limits of their capabilities. Itâ€™s exhilarating knowing youâ€™ve pwned a system and have TOTAL control over it, as well as the many secrets it possesses. Itâ€™s even more exhilarating if you apply it on an unethical level and dabble in what you shouldnâ€™t (Iâ€™m NOT encouraging you to do this!)</p> <p></p> <p>In this case, since weâ€™re talking about Gray Hats, the thrill of the hunt for us is hunting whatever it is weâ€™re most passionate about when it comes to activism.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Why I Became A Hacker? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The main reason I became a Hacker as well as a Cyber Security professional is to assist organizations that help track down and stop human trafficking operations, as well as anything along the lines of CSAM content distribution and a lot more. In other wordsâ€¦.. I HUNT PREDATORS AND AM OBSESSED WITH DOING SO! If you would like to find out more about what CSAM is and why I fight against it check out one of my articles in the main catalog. I wrote it a while back to help raise awareness for how end to end encryption assists Child Predators online.</p> <p></p> <p>Although there are MANY things I would do to a predator if one were presented in front of meâ€¦ I need a way to get my hands dirty while keeping it ethical! By working with organizations, even ghost ones for example that assist law enforcement, I can do just that, creating a world safer for women and children, most of which are the main target for these forms of operations.</p> <p></p> <p>There are also many other areas of activism I fancy such as hunt</p> <p></p> <p>ğŸƒ Hunting scammers (Iâ€™m looking at you JOB SCAMMERS)</p> <p></p> <p>ğŸƒ Hunting domestic violence perpetrators</p> <p></p> <p>and a lot more.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What Inspired me to Hunt Predators? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Iâ€™ve talked about this before, but my best friend was almost a victim of sexual assault and a lot more, where her step father abused her and put her in situations no little girl should have to go through, her mother being one of the many bystanders that allowed this to happen. Thereâ€™s an inspirational I made you should check out if you wanna hear my view points on why we need to teach children how to protect themselves online. Link to it can be found in the advanced format for this article on both Desktop and mobile. </p> <p></p> <p>A lot of Child predators exist among us, most of which go unnoticed since their targets are usually those that are unable to defend themselves and or unable to tell when theyâ€™re being taken advantage of. There are also groups of people, usually on the dark net, that create content and distribute it amongst themselves as some sort of fetish party, often getting away with it due to various protocols such as the TOR onion one that assist in protecting their anonymity online.</p> <p></p> <p>By hunting predators and exposing their identities as well as how they are able to do what they do, I aim to help clean up the internet and help make it a safer place for Children online. All of this, of course, could also apply to what Iâ€™ve stated before about help fighting human traffic operations.</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">The Evil HERO ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>The Evil HERO is a side brand that Iâ€™ll be launching in the near future that focuses on partnering with organizations that help combat the things Iâ€™ve talked about in this article. It is symbolic for a HERO, or rather, an Anti-HERO that is willing to do whatever it takes in order to fight predatory activities.</p> <p></p> <p>Iâ€™ll be having side content that will strictly be there, focusing on news and updates regarding various predatory activities and what we can do to stop them.</p> <p></p> <p></p> <p>If you enjoyed this post give it a thumbs up! Iâ€™ll be keeping track of whose reacting from now on as there is a â€œspecialâ€ reason for it. Just know the more you support my content the more there is in stored!</p> <p></p> <p></p> <p>- The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸</p> </br></br>  </div>`;
        
