    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;">  <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/CrowdStrikesFoulPlay.jpg" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <h4 style = "text-align: center; color: #D43F52;">Synopsis ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Todayâ€™s article is going to focus on a sensitive topic regarding CrowdStrike, where they basically mocked one of their clientele, Delta Air lines, who was affected during the CrowdStrike outage, essentially shifting the blame and stating their delay in recovery was their fault. This is a BIG deal seeing as their reputation is on the line and they crippled 8.5 million systems around the globe, some of which were medical systems which is a BIG deal!</p> <p></p> <p>In other words, to better summarize this, they basically said â€œNah bro itâ€™s YOUR fault your systems went down!â€</p> <p></p> <p>I spoke about the matter before and discussed why itâ€™s actually considered a security incident, one of the biggest weâ€™ve ever had, many of which thought the complete opposite.</p> <p></p> <p>I also dived into a sensitive topic regarding cloud based security and the overall dangers of it. If you would like to hear more about it, including a lot of my original points surrounding the CrowdStrike incident, check out this post here where I give my full insights on the matter.</p> <p></p> <p>The goal of todayâ€™s article is to discuss an important matter on WHEN itâ€™s the end users fault or the vendor/providers fault during a security incident/breach. This is a HIGHLY debated matter thatâ€™s usually skewed all across the board!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Is it Deltaâ€™s Fault? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>NO! It is NOT their fault it took them so long to recover. Donâ€™t let the gaslighting fool you, itâ€™s CrowdStrikes fault!</p> <p></p> <p>Be mindful, the CrowdStrike incident CRASHED systems, and when I mean CRASH, I mean BLUE SCREEN of death crash, meaning the entire system was NON functional and needed a hard reboot! Every system that had incorporated their software was essentially taken off the map!</p> <p></p> <p>Crowdstrikes counter argument to them was partially because Delta Air Lines admitted to turning off automatic updates from them which they consider to be â€œlack of Cyber Security knowledgeâ€ on their end, which IS NOT bad Cyber Security practice! Itâ€™s good to do manual updates as you can filter out any bad updates should they occur! HOWEVER, be mindful, they did not refuse to apply major security updates where needed, so that argument from CrowdStike is a slap in the face to one of their victims!</p> <p></p> <p>Also, even with them turning auto updates off, they were STILL impacted during the major security incident! I want you to let that sink in a bit!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">When is it the End Users Fault? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Ever have stuff like MFA and various other security upgrades from apps shoved in your face? Ever had it forced on you otherwise you LITERALLY canâ€™t use the app? It probably felt like a cold call from a salesman and you probably opted out of it just so you can go on with your day.</p> <p></p> <p>THAT my friend is WHEN itâ€™s the end users fault!</p> <p></p> <p>Itâ€™s only the end users fault when they CHOOSE to NOT apply the security you set in place! CrowdStrike on the other hand, EVERYONE relied on it and CHOOSE to apply their security into their systems!</p> <p></p> <p>Another example of when it would be the end user's fault, is a penetration tester telling them whatâ€™s wrong with their systems and they CHOOSE to accept the risk rather than mitigate it!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">When is it the Vendors Fault? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Itâ€™s only the vendor/providers fault when they FAIL to maintain the security for their systems set in place to protect end users.</p> <p></p> <p>A good example of this would of course be none other than CrowdStrike themselves, where EVERYONE applied the security but CrowdStrike FAILED to MAINTAIN the security!</p> <p></p> <p>Be mindful, CrowdStrike provides cloud based SECURITY to peopleâ€¦. soâ€¦. if they FAIL to maintain itâ€¦ EVERYONE that relied on their service faced not only a security outage, but someâ€¦ A SECURITY BREACH!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">What Should CrowdStrike Do? ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>COMPENSATE THEM OF COURSE!</p> <p></p> <p>Itâ€™s sad when the best of the best stoop so low and avoid accountability!</p> <p></p> <p></p> <p>If you enjoyed this post give it a thumbs up! Iâ€™ll be keeping track of whose reacting from now on as there is a â€œspecialâ€ reason for it. Just know the more you support my content the more there is in stored!</p> <p></p> <p></p> <p>- The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸</p> </br></br>  </div>`;
        
