function DocumentingYourJourney()
{
    //When the spider button is called, it will write out the modal elements on the page for our pumpkin to define
    document.getElementById('testq').innerHTML = `<div class="modal-body" style = "text-align: left; font-weight: normal;"> <img class = "img-thumbnail mt-4 Modal_Pic_Ransomware" src = "Images/DocumentingYourJourney.jpg" style = "border-color: violet; background-color: indigo; height: 250px;"> </br></br> <h4 style = "text-align: center; color: #D43F52;">Synopsis ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Todayâ€™s article is going to be centered around WHY you should document your Cyber Security journey!</p> <p></p> <p>Iâ€™m going to walk you through on the overall benefits of documenting your journey, most of which carries over to Software development or any other areas in tech.</p> <p></p> <p>You'll learn a lot of key stuff that could help you on your Cyber Security journey!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">Itâ€™s IMPOSSIBLE to Remember EVERYTHING! ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>When youâ€™re picking up new skills for Cyber Security and learning more about new technologies, one of the main difficulties youâ€™ll soon come to notice is youâ€™ll often run into scenarios where you â€œforgotâ€ something. This leads to you having to backtrack and find the EXACT resource you came across in order to solve a problem youâ€™ve encountered before, OR, simply needing to recall a bit of information for trivia reasons if need be. This could cost you HOURS of time.</p> <p></p> <p>By documenting all your findings and research, should you ever run into this type of situation, youâ€™ll have more quick access and be able to easily grep what you need. As long as you ORGANIZE everything, youâ€™ll have no trouble finding what you need.</p> <p></p> <p>Iâ€™ve been documenting all my research and findings for over 12 YEARS in tech: videos, links, html pages of exact sources that have been redacted, EVERYTHING! I write my own research material and quick guides so in the event I donâ€™t remember something accurately or I need to recall a technique, I can pull it up no worries, saving me the trouble of having to remember everything and dig for it again. In other words, I HAVE CHEAT SHEETS ON DECK!</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">It Helps you Solve Problems ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>Going back to that thing I mentioned before, it being able to help you with solving problems. YES, DOCUMENTING YOUR JOURNEYâ€¦ DOESâ€¦ HELPâ€¦ YOUâ€¦ SOLVEâ€¦ PROBLEMS!!!!</p> <p></p> <p>Many times Iâ€™ve been in situations where I KNEW how to solve something, but FORGOT</p> <p></p> <p>HOW to solve it, specifically the thing I did in the past that worked. Usually for me the answer is ALWAYS on the tip of my tongue, OR, Iâ€™ll know the name of it along with partial information.</p> <p></p> <p>For example, when I was working on my Crypto Malware exploit, I FORGOT all about the Queue module but KNEW it was the KEY to helping me create the exploit! Because I documented my past code snippets on it, and it it was neatly organized, I was able to pull it up and borrow what I needed for it, further dissecting it, in order to craft the exploit, which I cut into a demo for people to learn from</p> </br></br> <h4 style = "text-align: center; color: #D43F52;">You Pick Up Soft Skills ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸ </h4> <p>When you document your journey, oftentimes youâ€™ll be FORCED to break it all down and simplify it so that you, the creator, is able to interpret/reinterpret said information when need be.</p> <p></p> <p>This is a GOOD habit to get into, as it allows you to get GOOD at explaining how well you understand the various tech and techniques you learn in Cyber.</p> <p></p> <p>Part of being a GOOD Cyber Security professional is being able to have solid soft skills. It allows you to better explain what you know to people that might not be all too technical, which could aid you in many areas: leadership roles should you pursue it, interviews with tech leads that want to see what you know, even content should you be interested in creating your own.</p> <p></p> <p>Part of the main reason why Iâ€™m so good at teaching complex topics in Cyber as well as breaking it down for you is due to me developing my soft skills.</p> <p></p> <p></p> <p>If you enjoyed this post give it a thumbs up! Iâ€™ll be keeping track of whose reacting from now on as there is a â€œspecialâ€ reason for it. Just know the more you support my content the more there is in stored!</p> <p></p> <p></p> <p>- The Hacker Who Laughs ğŸ•¸ğŸ•¸ğŸƒğŸ•¸ğŸ•¸</p> </br></br>  </div>`;
        
}

